INSERT INTO `champions` (`id`, `name`, `region`, `role`, `title`, `voice`, `story`, `splash_art`, `animated_splash_art`, `position_x`, `position_y`, `release_date`, `updated_date`) VALUES
('Aatrox', 'Aatrox', 'Runeterra', 'Fighter', 'the Darkin Blade', 'I must destroy even hope…', 'Once honored defenders of Shurima against the Void, Aatrox and his brethren would eventually become an even greater threat to Runeterra, and were defeated only by cunning mortal sorcery. But after centuries of imprisonment, Aatrox was the first to find freedom once more, corrupting and transforming those foolish enough to try and wield the magical weapon that contained his essence. Now, with stolen flesh, he walks Runeterra in a brutal approximation of his previous form, seeking an apocalyptic and long overdue vengeance.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/A/Aatrox/Aatrox_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/606a1890faae447a7ea465d62b1dc87ab6ab360d.webm', 71, 28, '2013-06-13', '2018-05-29'),
('Ahri', 'Ahri', 'Ionia', 'Mage', 'The Nine-Tailed Fox', 'Human emotions can be more volatile than even the deepest magic.', 'Innately connected to the magic of the spirit realm, Ahri is a fox-like vastaya who can manipulate her prey\'s emotions and consume their essence—receiving flashes of their memory and insight from each soul she consumes. Once a powerful yet wayward predator, Ahri is now traveling the world in search of remnants of her ancestors while also trying to replace her stolen memories with ones of her own making.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/A/Ahri/Ahri_0.jpg', '', 61, 11, '2011-12-14', '2023-01-25'),
('Akali', 'Akali', 'Ionia', 'Assassin', 'the Rogue Assassin', 'If you look dangerous, you better be dangerous.', ' Abandoning the Kinkou Order and her title of the Fist of Shadow, Akali now strikes alone, ready to be the deadly weapon her people need. Though she holds onto all she learned from her master Shen, she has pledged to defend Ionia from its enemies, one kill at a time. Akali may strike in silence, but her message will be heard loud and clear: fear the assassin with no master.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/A/Akali/Akali_0.jpg', '', 50, 8, '2010-05-11', '2018-08-01'),
('Akshan', 'Akshan', 'Shurima', 'Marksman', 'the Rogue Sentinel', 'Not everything happens for a reason. Some things need to be sorted out.', 'Raising an eyebrow in the face of danger, Akshan fights evil with dashing charisma, righteous vengeance, and a conspicuous lack of shirts. He is highly skilled in the art of stealth combat, able to evade the eyes of his enemies and reappear when they least expect him. With a keen sense of justice and a legendary death-reversing weapon, he rights the wrongs of Runeterra’s many scoundrels while living by his own moral code: “Don’t be an ass.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/A/Akshan/Akshan_0.jpg', '', 68, 51, '2021-07-22', NULL),
('Alistar', 'Alistar', 'Runeterra', 'Tank', 'the Minotaur', 'Nothing can hold me back!', 'Always a mighty warrior with a fearsome reputation, Alistar seeks revenge for the death of his clan at the hands of the Noxian empire. Though he was enslaved and forced into the life of a gladiator, his unbreakable will was what kept him from truly becoming a beast. Now, free of the chains of his former masters, he fights in the name of the downtrodden and the disadvantaged, his rage as much a weapon as his horns, hooves and fists.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/A/Alistar/Alistar_0.jpg', '', 65, 30, '2009-02-21', NULL),
('Ambessa', 'Ambessa', 'Noxus', 'Fighter', 'the Matriarch of War', 'Any enemy of mine is an enemy of my family.', 'All who know the name Medarda respect and fear the family\'s leader, Ambessa. As a Noxian general, she embodies a deadly combination of ruthless strength and fearless resolve in battle. Her role as matriarch is no different, requiring great cunning to empower the Medardas while leaving no room for failure or compassion. Embracing the merciless ways of the Wolf, Ambessa will do whatever it takes to protect her family\'s legacy, even at the cost of her own children\'s love.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/A/Ambessa/Ambessa_0.jpg', '', 50, 5, '2024-11-06', NULL),
('Amumu', 'Amumu', 'Shurima', 'Tank', 'the Sad Mummy', 'Solitude can be lonelier than death.', 'Legend claims that Amumu is a lonely and melancholy soul from ancient Shurima, roaming the world in search of a friend. Doomed by an ancient curse to remain alone forever, his touch is death, his affection ruin. Those who claim to have seen him describe a living cadaver, small in stature and wrapped in creeping bandages. Amumu has inspired myths, songs, and folklore told and retold for generations—such that it is impossible to separate truth from fiction.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/A/Amumu/Amumu_0.jpg', '', 75, 20, '2009-06-26', NULL),
('Anivia', 'Anivia', 'The_Freljord', 'Mage', 'the Cryophoenix', 'I am the fury of the blizzard, the bite of the wind, and the cold of the ice. I am the Freljord.', 'Anivia is a benevolent winged spirit who endures endless cycles of life, death, and rebirth to protect the Freljord. A demigod born of unforgiving ice and bitter winds, she wields those elemental powers to thwart any who dare disturb her homeland. Anivia guides and protects the tribes of the harsh north, who revere her as a symbol of hope, and a portent of great change. She fights with every ounce of her being, knowing that through her sacrifice, her memory will endure, and she will be reborn into a new tomorrow.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/A/Anivia/Anivia_0.jpg', '', 50, 20, '2009-07-10', NULL),
('Annie', 'Annie', 'Runeterra', 'Mage', 'the Dark Child', 'Ashes, ashes, they all fall down.', 'Dangerous, yet disarmingly precocious, Annie is a child mage with immense pyromantic power. Even in the shadows of the mountains north of Noxus, she is a magical outlier. Her natural affinity for fire manifested early in life through unpredictable, emotional outbursts, though she eventually learned to control these “playful tricks.” Her favorite includes the summoning of her beloved teddy bear, Tibbers, as a fiery protector. Lost in the perpetual innocence of childhood, Annie wanders the dark forests, always looking for someone to play with.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/A/Annie/Annie_0.jpg', '', 86, 20, '2009-02-21', NULL),
('Aphelios', 'Aphelios', 'Targon', 'Marksman', 'the Weapon of the Faithful', 'Our faith is proven fate each time we deny it.', 'Emerging from moonlight\'s shadow with weapons drawn, Aphelios kills the enemies of his faith in brooding silence—speaking only through the certainty of his aim, and the firing of each gun. Though fueled by a poison that renders him mute, he is guided by his sister Alune. From her distant temple sanctuary, she pushes an arsenal of moonstone weapons into his hands. For as long as the moon shines overhead, Aphelios will never be alone.\r\nRole\r\n\r\nMarksman\r\n\r\n', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/A/Aphelios/Aphelios_0.jpg', '', 52, 5, '2020-01-14', NULL),
('Ashe', 'Ashe', 'The_Freljord', 'Marksman', 'the Frost Archer', 'All the world on one arrow.', ' Iceborn warmother of the Avarosan tribe, Ashe commands the most populous horde in the north. Stoic, intelligent, and idealistic, yet uncomfortable with her role as leader, she taps into the ancestral magics of her lineage to wield a bow of True Ice. With her people’s belief that she is the mythological hero Avarosa reincarnated, Ashe hopes to unify the Freljord once more by retaking their ancient, tribal lands.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/A/Ashe/Ashe_0.jpg', '', 70, 5, '2009-02-21', NULL),
('AurelionSol', 'Aurelion Sol', 'Runeterra', 'Mage', 'The Star Forger', 'Cower. Worship. Marvel. They are all appropriate responses.', ' Aurelion Sol once graced the vast emptiness of the celestial realm with wonders of his own devising, but was tricked by the Aspects of Targon into revealing the secrets of a sun that he himself created. His awesome power was channeled into immortal god-warriors to protect the apparently insignificant world of Runeterra—now, desiring a return to his mastery of the cosmos, Aurelion Sol will drag the very stars from the sky, if he must, in order to regain his freedom.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/A/AurelionSol/AurelionSol_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/36e23e03ec34c0951ed9ddae6b94970ba3ef5290.webm', 62, 18, '2016-03-24', '2023-10-02'),
('Aurora', 'Aurora', 'The_Freljord', 'Mage', 'the Witch Between Worlds', 'I see the spirit realm and material realm simultaneously. This blended world is my own, and it\'s beautiful.', 'From the moment she was born, Aurora navigated life with a unique ability to move between the spirit and material realms. Determined to learn more about the spirit realm\'s inhabitants, she left her home to further her research and happened upon a wayward demigod who\'d become twisted and lost to time. Witnessing his desperation, Aurora resolved to find a way to help her feral friend regain his forgotten identity—a journey that would take her to the farthest reaches of the Freljord.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/A/Aurora/Aurora_0.jpg', '', 58, 3, '2024-07-17', NULL),
('Azir', 'Azir', 'Shurima', 'Mage', 'the Emperor of the Sands', 'Shurima! Your emperor has returned!', ' Azir was a mortal emperor of Shurima in a far distant age, a proud man who stood at the cusp of immortality. His hubris saw him betrayed and murdered at the moment of his greatest triumph, but now, millennia later, he has been reborn as an Ascended being of immense power. With his buried city risen from the sand, Azir seeks to restore Shurima to its former glory.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/A/Azir/Azir_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/07df115d79f735cf45c50f552d2ebd06b77be955.webm', 84, 13, '2014-09-16', NULL),
('Bard', 'Bard', 'Runeterra', 'Support', 'the Wandering Caretaker', 'The chimes of his footsteps are echoes of change.', ' Atraveler from beyond the stars, Bard is an agent of serendipity who strives to maintain the harmony between creation, and the cold indifference of what lies beyond it. Many Runeterrans sing songs that ponder his extraordinary nature, yet they all agree that the cosmic vagabond is drawn to artifacts of great magical power. Surrounded by a jubilant choir of helpful meeps, it is impossible to mistake his actions as malevolent, as Bard always serves the greater good… in his own odd way.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/B/Bard/Bard_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/481b1a9abb6d3228c194e899d573a2ca6a9602a9.webm', 65, 12, '2015-03-12', NULL),
('BelVeth', 'Bel\'Veth', 'The_Void', 'Fighter', 'the Empress of the Void', 'This world will not be forgotten. I will replace it—a child devouring its parent.', 'A nightmarish empress created from the raw material of an entire devoured city, Bel\'Veth is the end of Runeterra itself... and the beginning of a monstrous reality of her own design. Driven by epochs of repurposed history, knowledge, and memories from the world above, she voraciously feeds an ever-expanding need for new experiences and emotions, consuming all that crosses her path. Yet her wants could never be sated by only one world as she turns her hungry eyes toward the Void\'s old masters...', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/B/BelVeth/BelVeth_0.jpg', '', 47, 28, '2022-04-14', NULL),
('Blitzcrank', 'Blitzcrank', 'Zaun', 'Tank', 'the Great Steam Golem', 'A SINGLE GEAR TURNING CAN MAKE ALL THE DIFFERENCE.', 'Blitzcrank is an enormous, near-indestructible automaton from Zaun, originally built to dispose of hazardous waste. However, he found this primary purpose too restricting, and modified his own form to better serve the fragile people of the Sump. Blitzcrank selflessly uses his strength and durability to protect others, extending a helpful metal fist or burst of energy to subdue any troublemakers.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/B/Blitzcrank/Blitzcrank_0.jpg', '', 78, 16, '2009-09-02', NULL),
('Brand', 'Brand', 'Runeterra', 'Mage', 'the Burning Vengeance', 'This place will burn, not by cinder flying or breath of wind, but by the vengeance of my hand.', 'Once a tribesman of the icy Freljord named Kegan Rodhe, the creature known as Brand is a lesson in the temptation of greater power. Seeking one of the legendary World Runes, Kegan betrayed his companions and seized it for himself—and, in an instant, the man was no more. His soul burned away, his body a vessel of living flame, Brand now roams Valoran in search of other Runes, swearing revenge for wrongs he could never possibly have suffered in a dozen mortal lifetimes.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/B/Brand/Brand_0.jpg', '', 88, 7, '2011-04-12', NULL),
('Braum', 'Braum', 'The_Freljord', 'Tank', 'the Heart of the Freljord', 'Today, we fight as enemies. Tomorrow, we may fight as brothers.', 'Blessed with massive biceps and an even bigger heart, Braum is a beloved Iceborn hero of the Freljord. Every mead hall north of Frostheld toasts his legendary strength and tells tales of how he felled a forest of oaks in a single night, and punched an entire mountain into rubble. With his shield, an enchanted vault door forged in ages past, Braum roams the frozen north as a cheerful protector, helping the vulnerable as he works toward his dream of a peaceful Freljord.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/B/Braum/Braum_0.jpg', '', 89, 4, '2014-05-12', NULL),
('Briar', 'Briar', 'Noxus', 'Fighter', 'the Restrained Hunger', 'I don’t lose control, I free myself from control.', 'Afailed experiment by the Black Rose, Briar’s uncontrollable bloodlust required a special pillory to focus her frenzied mind. After years of confinement, this living weapon broke free from her restraints and unleashed herself into the world. Now she’s controlled by no one—following only her hunger for knowledge and blood—and relishes the opportunities to let loose, even if reining back the frenzy isn’t easy.\r\n\r\n', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/B/Briar/Briar_0.jpg', '', 56, 28, '2023-09-13', NULL),
('Caitlyn', 'Caitlyn', 'Piltover', 'Marksman', 'the Sheriff of Piltover', 'To be the best hunter, you have to be able to think like your prey.', 'Renowned as its finest peacekeeper, Caitlyn is also Piltover’s best shot at ridding the city of its elusive criminal elements. She is often paired with Vi, acting as a cool counterpoint to her partner’s more impetuous nature. Even though she carries a one-of-a-kind hextech rifle, Caitlyn’s most powerful weapon is her superior intellect, allowing her to lay elaborate traps for any lawbreakers foolish enough to operate in the City of Progress.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/C/Caitlyn/Caitlyn_0.jpg', '', 80, 1, '2011-01-04', NULL),
('Camille', 'Camille', 'Piltover', 'Fighter', 'the Steel Shadow', 'Precision is the difference between a butcher and a surgeon.', ' Weaponized to operate outside the boundaries of the law, Camille is the Principal Intelligencer of Clan Ferros—an elegant and elite agent who ensures the Piltover machine and its Zaunite underbelly run smoothly. Adaptable and precise, she views sloppy technique as an embarrassment that must be put to order. With a mind as sharp as the blades she bears, Camille\'s pursuit of superiority through hextech body augmentation has left many to wonder if she is now more machine than human.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/C/Camille/Camille_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/4eff0baf3549e977e23969cdab560b1e9a26123f.webm', 95, 1, '2016-12-07', NULL),
('Cassiopeia', 'Cassiopeia', 'Noxus', 'Mage', 'the Serpent\'s Embrace', 'Secrets are sharper than blades…', 'Cassiopeia is a deadly creature bent on manipulating others to her will. Youngest and most beautiful daughter of the noble Du Couteau family of Noxus, she ventured deep into the crypts beneath Shurima in search of ancient power. There, she was bitten by a gruesome tomb guardian, whose venom transformed her into a viper-like predator. Cunning and agile, Cassiopeia now slithers under the veil of night, petrifying her enemies with her baleful gaze.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/C/Cassiopeia/Cassiopeia_0.jpg', '', 65, 8, '2010-12-14', NULL),
('ChoGath', 'Cho\'Gath', 'The_Void', 'Tank', 'the Terror of the Void', 'Your souls will feed the Void!', 'From the moment Cho’Gath first emerged into the harsh light of Runeterra’s sun, the beast was driven by the most pure and insatiable hunger. A perfect expression of the Void’s desire to consume all life, Cho’Gath’s complex biology quickly converts matter into new bodily growth—increasing its muscle mass and density, or hardening its outer carapace like organic diamond. When growing larger does not suit the Void-spawn’s needs, it vomits out the excess material as razor-sharp spines, leaving prey skewered and ready to feast upon later.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/C/ChoGath/ChoGath_0.jpg', '', 59, 27, '2009-06-26', NULL),
('Corki', 'Corki', 'Bandle_City', 'Marksman', 'the Daring Bombardier', 'Death from above!', 'The yordle pilot Corki loves two things above all others: flying, and his glamorous mustache... though not necessarily in that order. After leaving Bandle City, he settled in Piltover and fell in love with the wondrous machines he found there. He dedicated himself to the development of flying contraptions, leading an aerial defense force of seasoned veterans known as the Screaming Yipsnakes. Calm under fire, Corki patrols the skies around his adopted home, and has never encountered a problem that a good missile barrage couldn\'t solve.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/C/Corki/Corki_0.jpg', '', 80, 13, '2009-09-19', NULL),
('Darius', 'Darius', 'Noxus', 'Fighter', 'the Hand of Noxus', 'History only remembers the victors. Stand with Noxus, and be remembered forever.', 'There is no greater symbol of Noxian might than Darius, the nation\'s most feared and battle-hardened commander. Rising from humble origins to become the Hand of Noxus, he cleaves through the empire\'s enemies—many of them Noxians themselves. Knowing that he never doubts his cause is just, and never hesitates once his axe is raised, those who stand against the leader of the Trifarian Legion can expect no mercy.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/D/Darius/Darius_0.jpg', '', 55, 0, '2012-05-23', NULL),
('Diana', 'Diana', 'Targon', 'Fighter', 'Scorn of the Moon', 'I am the light coursing in the soul of the moon.', 'Bearing her crescent moonblade and clad in shimmering armor the color of winter snow at night, Diana is a living embodiment of the silver moon’s power. Imbued with the essence of an Aspect from beyond Targon’s towering summit, Diana is no longer wholly human, and struggles to understand her power and purpose in this world.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/D/Diana/Diana_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/e45ef4c6ec195042d82ca53cfce2ff4cc93bdf74.webm', 78, 33, '2012-08-07', NULL),
('Draven', 'Draven', 'Noxus', 'Marksman', 'the Glorious Executioner', '\'The best\' is wherever I decide to set the bar each day.', 'In Noxus, warriors known as Reckoners face one another in arenas where blood is spilled and strength tested—but none has ever been as celebrated as Draven. A former soldier, he found that the crowds uniquely appreciated his flair for the dramatic, and his unparalleled skill with his spinning axes. Addicted to the spectacle of his own brash perfection, Draven has sworn to defeat whomever he must to ensure that his name is chanted throughout the empire forever more.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/D/Draven/Draven_0.jpg', '', 80, 14, '2012-06-06', NULL),
('DrMundo', 'Dr. Mundo', 'Zaun', 'Fighter', 'the Madman of Zaun', 'Me must be good doctor. Patients never come back.', 'Utterly mad, tragically homicidal, and horrifyingly purple, Dr. Mundo is what keeps many of Zaun\'s citizens indoors on particularly dark nights. Now a self-proclaimed physician, he was once a patient of Zaun\'s most infamous asylum. After \"curing\" the entire staff, Dr. Mundo established his practice in the empty wards that once treated him and began mimicking the highly unethical procedures he had so often experienced himself. With a full cabinet of medicines and zero medical knowledge, he now makes himself more monstrous with each injection and terrifies the hapless \"patients\" who wander near his office.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/D/DrMundo/DrMundo_0.jpg', '', 54, 9, '2009-09-02', NULL),
('Ekko', 'Ekko', 'Zaun', 'Assassin', 'the Boy Who Shattered Time', 'My devices work best when they don’t work as intended… which is most of the time.', 'A prodigy from the rough streets of Zaun, Ekko is able to manipulate time to twist any situation to his advantage. He uses his own invention, the Z-Drive, to explore the branching possibilities of reality, crafting the perfect moment to seemingly achieve the impossible the first time, every time. Though Ekko revels in this freedom, when there\'s a threat to those he cares about, he and the Firelights will do anything to defend them.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/E/Ekko/Ekko_0.jpg', '', 87, 4, '2015-05-29', NULL),
('Elise', 'Elise', 'Shadow_Isles', 'Mage', 'the Spider Queen', 'Beauty is power too, and can strike swifter than any sword.', 'Elise is a deadly predator who dwells in a shuttered, lightless palace, deep within the oldest city of Noxus. She was once the mistress of a powerful noble house, until the bite of a vile spider-god transformed her into something utterly inhuman, yet still beautiful—an arachnoid creature, drawing unsuspecting prey into her web. Elise now feeds upon the naive and the faithless, and there are few who can resist her seductions.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/E/Elise/Elise_0.jpg', '', 80, 14, '2012-10-26', NULL),
('Evelynn', 'Evelynn', 'Runeterra', 'Assassin', 'Agony\'s Embrace', 'You know you want me.', ' Within the dark seams of Runeterra, the demon Evelynn searches for her next victim. She lures in prey with the voluptuous façade of a human female, but once a person succumbs to her charms, Evelynn’s true form is unleashed. She then subjects her victim to unspeakable torment, gratifying herself with their pain. To the demon, these liaisons are innocent flings. To the rest of Runeterra, they are ghoulish tales of lust gone awry and horrific reminders of the cost of wanton desire.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/E/Evelynn/Evelynn_0.jpg', '', 51, 12, '2009-05-01', NULL),
('Ezreal', 'Ezreal', 'Piltover', 'Marksman', 'the Prodigal Explorer', 'If I don’t know the rules, then how can I be breaking them?', 'Adashing adventurer, unknowingly gifted in the magical arts, Ezreal raids long-lost catacombs, tangles with ancient curses, and overcomes seemingly impossible odds with ease. His courage and bravado knowing no bounds, he prefers to improvise his way out of any situation, relying partially on his wits, but mostly on his mystical Shuriman gauntlet, which he uses to unleash devastating arcane blasts. One thing is for sure—whenever Ezreal is around, trouble isn’t too far behind. Or ahead. Probably everywhere.\r\n\r\n', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/E/Ezreal/Ezreal_0.jpg', '', 67, 20, '2010-03-16', NULL),
('Fiddlesticks', 'Fiddlesticks', 'Runeterra', 'Mage', 'the Ancient Fear', 'It\'s hunting us. It knows what we\'re afraid of.', 'Something has awoken in Runeterra. Something ancient. Something terrible. The ageless horror known as Fiddlesticks stalks the edges of mortal society, drawn to areas thick with paranoia where it feeds upon terrorized victims. Wielding a jagged scythe, the haggard, makeshift creature reaps fear itself, shattering the minds of those unlucky enough to survive in its wake. Beware the sounding of the crow, or the whispering of the shape that appears almost human… Fiddlesticks has returned.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/F/Fiddlesticks/Fiddlesticks_0.jpg', '', 37, 48, '2009-02-21', NULL),
('Fiora', 'Fiora', 'Demacia', 'Fighter', 'the Grand Duelist', 'I have come to kill you for the sake of honor. And though you possess none, still you die.', 'The most feared duelist in all Valoran, Fiora is as renowned for her brusque manner and political cunning as she is for the speed of her rapier. Born to the noble Laurent family in Demacia, Fiora claimed the household from her father in the wake of a scandal that nearly destroyed them—now she is dedicated to restoring the Laurents to their rightful place among the great and good of the kingdom.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/F/Fiora/Fiora_0.jpg', '', 68, 0, '2012-02-29', NULL),
('Fizz', 'Fizz', 'Runeterra', 'Assassin', 'the Tidal Trickster', 'You people can’t even breathe water. You’re boring.', 'Fizz is an amphibious yordle, who dwells among the reefs surrounding Bilgewater. He often retrieves and returns the tithes cast into the sea by superstitious captains, but even the saltiest of sailors know better than to cross him—for many are the tales of those who have underestimated this slippery character. Often mistaken for some manner of capricious ocean spirit, he seems able to command the beasts of the deep, and delights in confounding his allies and enemies alike.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/F/Fizz/Fizz_0.jpg', '', 95, 15, '2011-11-15', NULL),
('Galio', 'Galio', 'Demacia', 'Tank', 'the Colossus', 'Get behind me, Demacian! You may not have noticed, but I’m very large.', 'Outside the gleaming city of Demacia, the stone colossus Galio keeps vigilant watch. Built as a bulwark against enemy mages, he often stands motionless for decades until the presence of powerful magic stirs him to life. Once activated, Galio makes the most of his time, savoring the thrill of a fight and the rare honor of defending his countrymen. But his triumphs are always bittersweet, for the magic he destroys is also his source of reanimation, and each victory leaves him dormant once again.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/G/Galio/Galio_0.jpg', '', 48, 9, '2010-08-10', NULL),
('Gangplank', 'Gangplank', 'Bilgewater', 'Fighter', 'the Saltwater Scourge', 'I was cutting throats and sinking Noxian war galleys when you were still pissing your britches, boy. You don’t want to take me on.', 'As unpredictable as he is brutal, the dethroned reaver king Gangplank is feared far and wide. Once, he ruled the port city of Bilgewater, and while his reign is over, there are those who believe this has only made him more dangerous. Gangplank would see Bilgewater bathed in blood once more before letting someone else take it—and now with pistol, cutlass, and barrels of gunpowder, he is determined to reclaim what he has lost.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/G/Gangplank/Gangplank_0.jpg', '', 78, 1, '2009-08-19', NULL),
('Garen', 'Garen', 'Demacia', 'Fighter', 'The Might of Demacia', 'This kingdom, and its people, have given me everything. What kind of man would I be if I gave any less in return?', 'Aproud and noble soldier, Garen fights at the head of the Dauntless Vanguard. He is popular among his fellows, and respected well enough by his enemies—not least as a scion of the prestigious Crownguard family, entrusted with defending Demacia and its ideals. Clad in magic-resistant armor and bearing a mighty broadsword, Garen stands ready to confront mages and sorcerers on the field of battle, in a veritable whirlwind of righteous steel.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/G/Garen/Garen_0.jpg', '', 90, 20, '2010-04-27', NULL),
('Gnar', 'Gnar', 'The_Freljord', 'Fighter', 'the Missing Link', 'Gnar!', 'Gnar is a primeval yordle whose playful antics can erupt into a toddler\'s outrage in an instant, transforming him into a massive beast bent on destruction. Frozen in True Ice for millennia, the curious creature broke free and now hops about a changed world he sees as exotic and wondrous. Delighted by danger, Gnar flings whatever he can at his enemies, be it his bonetooth boomerang, or a nearby building.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/G/Gnar/Gnar_0.jpg', NULL, 85, 68, '2014-08-14', NULL),
('Gragas', 'Gragas', 'The_Freljord', 'Fighter', 'the Rabble Rouser', 'Now this\'ll put hair on your chest!', 'Equal parts jolly and imposing, Gragas is a massive, rowdy brewmaster on his own quest for the perfect pint of ale. Hailing from parts unknown, he now searches for rare ingredients among the unblemished wastes of the Freljord, trying each recipe as he goes. Often intoxicated and extremely impulsive, he is legendary for the brawls he starts, which often end in all-night parties and widespread property damage. Any appearance from Gragas must surely foreshadow drinking and destruction—in that order.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/G/Gragas/Gragas_0.jpg', NULL, 65, 2, '2010-02-02', NULL),
('Graves', 'Graves', 'Bilgewater', 'Marksman', 'the Outlaw', 'We’re here for your gold, not your heads… so don’t nobody decide to be a hero.', 'Malcolm Graves is a renowned mercenary, gambler, and thief—a wanted man in every city and empire he has visited. Even though he has an explosive temper, he possesses a strict sense of criminal honor, often enforced at the business end of his double-barreled shotgun Destiny. In recent years, he has reconciled a troubled partnership with Twisted Fate, and together they have prospered once more in the turmoil of Bilgewater\'s criminal underbelly.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/G/Graves/Graves_0.jpg', NULL, 84, 0, '2011-10-19', NULL),
('Gwen', 'Gwen', 'Shadow_Isles', 'Fighter', 'The Hallowed Seamstress', 'The wind at my back feels so good. I can’t lose this. I won’t.', 'A former doll transformed and brought to life by magic, Gwen wields the very tools that once created her. She carries the weight of her maker\'s love with every step, taking nothing for granted. At her command is the Hallowed Mist, an ancient and protective magic that has blessed Gwen\'s scissors, needles, and sewing thread. So much is new to her, but Gwen remains joyfully determined to fight for the good that survives in a broken world.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/G/Gwen/Gwen_0.jpg', '', 50, 15, '2021-04-15', NULL),
('Hecarim', 'Hecarim', 'Shadow_Isles', 'Fighter', 'the Shadow of War', 'Break their ranks, and ride them down without mercy. Crush the living. Feast on their terror.', 'Hecarim is a spectral fusion of man and beast, cursed to ride down the souls of the living for all eternity. When the Blessed Isles fell into shadow, this proud knight was obliterated by the destructive energies of the Ruination, along with all his cavalry and their mounts. Now, whenever the Black Mist reaches out across Runeterra, he leads their devastating charge, reveling in the slaughter and crushing the foe beneath his armored hooves.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/H/Hecarim/Hecarim_0.jpg', NULL, 68, 2, '2012-04-18', NULL),
('Heimerdinger', 'Heimerdinger', 'Piltover', 'Mage', 'the Revered Inventor', 'Impossible, you say? Nonsense. Just wait till you see my calculations!', 'The eccentric Professor Cecil B. Heimerdinger is one of the most innovative and esteemed inventors the world has ever known. As the longest serving member of the Council of Piltover, he saw the best and the worst of the city\'s unending desire for progress. Nonetheless, this brilliant scientist and teacher will always remain dedicated to using his unconventional devices to improve the lives of others.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/H/Heimerdinger/Heimerdinger_0.jpg', NULL, 80, 35, '2009-10-10', NULL),
('Hwei', 'Hwei', 'Ionia', 'Mage', 'the Visionary', 'Calm and chaos—leave everything on the canvas.', 'Hwei is a brooding painter who creates brilliant art in order to confront Ionia\'s criminals and comfort their victims. Beneath his melancholy roils a torn, emotional mind—haunted by both the vibrant visions of his imagination and the gruesome memories of his temple\'s massacre. Hwei seeks to understand this light and dark, which drives him inevitably toward the artist who unraveled him. With paintbrush and palette, Hwei shapes endless possibilities as he draws ever closer to earning closure or embracing despair.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/H/Hwei/Hwei_0.jpg', '', 60, 0, '2023-12-06', NULL),
('Illaoi', 'Illaoi', 'Bilgewater', 'Fighter', 'the Kraken Priestess', 'Wisdom is frequently a kick in the head.', 'Illaoi\'s powerful physique is dwarfed only by her indomitable faith. As the prophet of the Great Kraken, she uses a huge, golden idol to rip her foes\' spirits from their bodies and shatter their perception of reality. All who challenge the “Truth Bearer of Nagakabouros” soon discover Illaoi never battles alone—the god of the Serpent Isles fights by her side.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/I/Illaoi/Illaoi_0.jpg', NULL, 64, 0, '2015-11-24', NULL),
('Irelia', 'Irelia', 'Ionia', 'Fighter', 'the Blade Dancer', 'Fight for the First Lands!', ' The Noxian occupation of Ionia produced many heroes, none more unlikely than young Irelia of Navori. Trained in the ancient dances of her province, she adapted her art for war, using the graceful and carefully practised movements to levitate a host of deadly blades. After proving herself as a fighter, she was thrust into the role of resistance leader and figurehead, and to this day remains dedicated to the preservation of her homeland.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/I/Irelia/Irelia_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/03cc763c5e5a5914e4de4f5598abe1b8cc99adeb.webm', 50, 12, '2010-11-16', NULL),
('Ivern', 'Ivern', 'Ionia', 'Support', 'the Green Father', 'The cleverness of mushrooms always surprises me.', 'Ivern Bramblefoot, known to many as the Green Father, is a peculiar half man, half tree who roams Runeterra\'s forests, cultivating life everywhere he goes. He knows the secrets of the natural world, and holds deep friendships with all things that grow, fly, and scuttle. Ivern wanders the wilderness, imparting strange wisdom to any he meets, enriching the forests, and occasionally entrusting loose-lipped butterflies with his secrets.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/I/Ivern/Ivern_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/a2021849f16b1d3cfe4e70dbc97fc32f8bfb8b86.webm', 50, 0, '2016-10-05', NULL),
('Janna', 'Janna', 'Zaun', 'Support', 'the Storm\'s Fury', 'The tempest is at your command.', ' An ancient and mysterious wind spirit, Janna has come to protect the dispossessed of Zaun. While her presence is most often felt as a soothing breeze or a ferocious tempest, she also can manifest in corporeal form as an ethereal figure, comforting the downtrodden. Over the eons, Janna has witnessed the rise and fall of civilizations. Through it all, she remains steadfast as a beacon of hope to those in need.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/J/Janna/Janna_0.jpg', '', 92, 21, '2009-09-02', NULL),
('JarvanIV', 'Jarvan IV', 'Demacia', 'Fighter', 'the Exemplar of Demacia', 'Words may make a ruler, but only actions make history.', 'Prince Jarvan, scion of the Lightshield dynasty, is heir apparent to the throne of Demacia. Raised to be a paragon of his nation\'s greatest virtues, he is forced to balance the heavy expectations placed upon him with his own desire to fight on the front lines. Jarvan inspires his troops with his fearsome courage and selfless determination, raising his family\'s colors high and revealing his true strength as a future leader of his people.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/J/JarvanIV/JarvanIV_0.jpg', NULL, 83, 5, '2011-03-01', NULL),
('Jax', 'Jax', 'Runeterra', 'Fighter', 'Grandmaster at Arms', 'Strength and will are what make a weapon.', 'Unmatched in both his skill with unique armaments and his biting sarcasm, Jax is the last known weapons master of Icathia. After his homeland was laid low by its own hubris in unleashing the Void, Jax and his kind vowed to protect what little remained. As magic now rises in the world, this slumbering threat stirs once more, and Jax roams Valoran, wielding the last light of Icathia and testing all warriors he meets to see if any are strong enough to stand beside him...', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/J/Jax/Jax_0.jpg', NULL, 69, 32, '2009-02-21', NULL),
('Jayce', 'Jayce', 'Piltover', 'Fighter', 'the Defender of Tomorrow', 'Picking a fight with me is the dumbest thing you’ve done today – and that’s saying a lot.', 'Jayce Talis is a brilliant inventor who, along with his friend Viktor, made the first great discoveries in the field of hextech. Celebrated across Piltover, he tries to live up to his reputation as \"the Man of Progress,\" but often struggles with the expectations placed upon him. Because of this, Jayce has begun to see the ways in which his invention has furthered the division between Piltover and Zaun—and armed with his hextech hammer, he stands ready to defend tomorrow.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/J/Jayce/Jayce_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/f5322735accb4ca58f0d5a68e2c233d21d507f2d.webm', 83, 25, '2012-07-07', NULL),
('Jhin', 'Jhin', 'Ionia', 'Marksman', 'the Virtuoso', 'In carnage, I bloom, like a flower in the dawn.', ' Jhin is a meticulous criminal psychopath who believes murder is art. Once an Ionian prisoner, but freed by shadowy elements within Ionia’s ruling council, the serial killer now works as their cabal\'s assassin. Using his gun as his paintbrush, Jhin creates works of artistic brutality, horrifying victims and onlookers. He gains a cruel pleasure from putting on his gruesome theater, making him the ideal choice to send the most powerful of messages: terror.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/J/Jhin/Jhin_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/20a1802bcbb42e21ae66152dffa25671d3b924b7.webm', 64, 0, '2016-02-01', NULL),
('Jinx', 'Jinx', 'Zaun', 'Marksman', 'the Loose Cannon', 'Volatile explosives are a girl’s best friend!', 'An unhinged and impulsive criminal from the undercity, Jinx is haunted by the consequences of her past—but that doesn\'t stop her from bringing her own chaotic brand of pandemonium to Piltover and Zaun. She uses her arsenal of DIY weapons to devastating effect, unleashing torrents of colorful explosions and gunfire, inspiring the disenfranchised to rebellion and resistance with the mayhem she leaves in her wake.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/J/Jinx/Jinx_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/26d3e24ee65154e21211df06994f8f1ef8aee380.webm', 74, 11, '2013-10-10', NULL),
('KaiSa', 'Kai\'Sa', 'The_Void', 'Marksman', 'Daughter of the Void', 'My appearance may frighten you, but make no mistake—I am on your side, and we fight to the bitter en', 'Claimed by the Void when she was only a child, Kai’Sa managed to survive through sheer tenacity and strength of will. Her experiences have made her a deadly hunter and, to some, the harbinger of a future they would rather not live to see. Having entered into an uneasy symbiosis with a living Void carapace, the time will soon come when she must decide whether to forgive those mortals who would call her a monster, and defeat the coming darkness together… or simply to forget, as the Void consumes the world that left her behind.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/K/KaiSa/KaiSa_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/aae82f09c0b6efdb47f0f6a58afbf2bdae3595e1.webm', 49, 18, '2018-03-07', NULL),
('Kalista', 'Kalista', 'Shadow_Isles', 'Marksman', 'the Spear of Vengeance', 'Turncoats, oath breakers and betrayers… we hate them all.', 'An undying specter of wrath and retribution, Kalista is an armored nightmare summoned from the Shadow Isles to hunt deceivers and traitors. The betrayed may cry out in blood to be avenged, but Kalista only answers those willing to pay with their very souls. Those who become the focus of Kalista’s wrath should make their final peace, for any pact sealed with this grim hunter can only be ended by the cold, piercing fire of her soul-spears.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/K/Kalista/Kalista_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/2153d9c1e61ab3d41b6909b6d7b38e6acba465c0.webm', 70, 7, '2014-11-05', NULL),
('Karma', 'Karma', 'Ionia', 'Mage', 'the Enlightened One', 'As Ionia changes, so must I.', ' No mortal exemplifies the spiritual traditions of Ionia more than Karma. She is the living embodiment of an ancient soul reincarnated countless times, carrying all her accumulated memories into each new life, and blessed with power that few can comprehend. She has done her best to guide her people in recent times of crisis, though she knows that peace and harmony may come only at a considerable cost—both to her, and to the land she holds most dear.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/K/Karma/Karma_0.jpg', '', 84, 2, '2011-02-01', NULL),
('Karthus', 'Karthus', 'Shadow_Isles', 'Mage', 'the Deathsinger', 'Death is not the end of the journey, it is just the beginning...', 'The harbinger of oblivion, Karthus is an undying spirit whose haunting songs are a prelude to the horror of his nightmarish appearance. The living fear the eternity of undeath, but Karthus sees only beauty and purity in its embrace, a perfect union of life and death. When Karthus emerges from the Shadow Isles, it is to bring the joy of death to mortals, an apostle of the unliving.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/K/Karthus/Karthus_0.jpg', NULL, 74, 0, '2009-06-12', NULL),
('Kassadin', 'Kassadin', 'The_Void', 'Assassin', 'the Void Walker', 'There are few indeed who may tread the paths between worlds.', 'Cutting a burning swath through the darkest places of the world, Kassadin knows his days are numbered. A widely traveled Shuriman guide and adventurer, he had chosen to raise a family among the peaceful southern tribes—until the day his village was consumed by the Void. He vowed vengeance, combining a number of arcane artifacts and forbidden technologies for the struggle ahead. Finally, Kassadin set out for the wastelands of Icathia, ready to face any monstrous Void-construct in his search for their self-proclaimed prophet, Malzahar.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/K/Kassadin/Kassadin_0.jpg', NULL, 65, 9, '2009-08-07', NULL),
('Katarina', 'Katarina', 'Noxus', 'Assassin', 'the Sinister Blade', 'Violence solves everything.', 'Decisive in judgment and lethal in combat, Katarina is a Noxian assassin of the highest caliber. Eldest daughter to the legendary General Du Couteau, she made her talents known with swift kills against unsuspecting enemies. Her fiery ambition has driven her to pursue heavily-guarded targets, even at the risk of endangering her allies—but no matter the mission, Katarina will not hesitate to execute her duty amid a whirlwind of serrated daggers.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/K/Katarina/Katarina_0.jpg', '', 65, 30, '2009-09-19', NULL),
('Kayle', 'Kayle', 'Demacia', 'Fighter', 'The Righteous', 'No human is perfect. But I am not human.', 'Born to a Targonian Aspect at the height of the Rune Wars, Kayle honored her mother’s legacy by fighting for justice on wings of divine flame. She and her twin sister Morgana were the protectors of Demacia for many years—until Kayle became disillusioned with the repeated failings of mortals, and abandoned this realm altogether. Still, legends are told of her punishing the unjust with her fiery swords, and many hope that she will one day return…', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/K/Kayle/Kayle_0.jpg', '', 15, 20, '2009-02-21', NULL),
('Kayn', 'Kayn', 'Ionia', 'Assassin', 'the Shadow Reaper', 'Will you prove worthy? - Probably not.', 'Apeerless practitioner of lethal shadow magic, Shieda Kayn battles to achieve his true destiny—to one day lead the Order of Shadow into a new era of Ionian supremacy. He wields the sentient darkin weapon Rhaast, undeterred by its creeping corruption of his body and mind. There are only two possible outcomes: either Kayn bends the weapon to his will... or the malevolent blade consumes him completely, paving the way for the destruction of all Runeterra.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/K/Kayn/Kayn_0.jpg', '', 51, 51, '2017-07-12', NULL),
('Kennen', 'Kennen', 'Ionia', 'Mage', 'the Heart of the Tempest', 'I exist across realms, in the space between lightning’s strike and thunder’s call, the true balance within the storm.', 'More than just the lightning-quick enforcer of Ionian balance, Kennen is the only yordle member of the Kinkou. Despite his small, furry stature, he is eager to take on any threat with a whirling storm of shuriken and boundless enthusiasm. Alongside his master Shen, Kennen patrols the spirit realm, employing devastating electrical energy to strike down his enemies.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/K/Kennen/Kennen_0.jpg', '', 80, 10, '2010-04-08', NULL),
('KhaZix', 'Kha\'Zix', 'The_Void', 'Assassin', 'the Voidreaver', 'Kill. Consume. Adapt.', 'The Void grows, and the Void adapts—in none of its myriad spawn are these truths more apparent than Kha\'Zix. Evolution drives the core of this mutating horror, born to survive and to slay the strong. Where it struggles to do so, it grows new, more effective ways to counter and kill its prey. Initially a mindless beast, Kha\'Zix\'s intelligence has developed as much as its form. Now, the creature plans out its hunts, and even utilizes the visceral terror it engenders in its victims.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/K/KhaZix/KhaZix_0.jpg', '', 81, 45, '2012-09-27', NULL),
('Kindred', 'Kindred', 'Runeterra', 'Marksman', 'The Eternal Hunters', 'Tell me again, little Lamb, which things are ours to take?”\r\n“All things, dear Wolf.', 'Separate, but never parted, Kindred represents the twin essences of death. Lamb\'s bow offers a swift release from the mortal realm for those who accept their fate. Wolf hunts down those who run from their end, delivering violent finality within his crushing jaws. Though interpretations of Kindred\'s nature vary across Runeterra, every mortal must choose the true face of their death.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/K/Kindred/Kindred_0.jpg', NULL, 81, 31, '2015-10-14', NULL);
INSERT INTO `champions` (`id`, `name`, `region`, `role`, `title`, `voice`, `story`, `splash_art`, `animated_splash_art`, `position_x`, `position_y`, `release_date`, `updated_date`) VALUES
('Kled', 'Kled', 'Noxus', 'Fighter', 'the Cantankerous Cavalier', 'A sane man would run… but I ain’t the runnin’ kind!', 'A warrior as fearless as he is ornery, the yordle Kled embodies the furious bravado of Noxus. He is an icon beloved by the empire\'s soldiers, distrusted by its officers, and loathed by the nobility. Many claim Kled has fought in every campaign the legions have waged, has “acquired” every military title, and has never once backed down from a fight. Though the truth of the matter is often questionable, one part of his legend is undeniable: Charging into battle on his un-trusty steed, Skaarl, Kled fights to protect what\'s his… and to take whatever he can get.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/K/Kled/Kled_0.jpg', '', 87, 1, '2023-01-12', NULL),
('KogMaw', 'Kog\'Maw', 'The_Void', 'Marksman', 'the Mouth of the Abyss', 'If that\'s just hungry, I don\'t want to see angry.', 'Belched forth from a rotting Void incursion deep in the wastelands of Icathia, Kog’Maw is an inquisitive yet putrid creature with a caustic, gaping mouth. This particular Void-spawn needs to gnaw and drool on anything within reach to truly understand it. Though not inherently evil, Kog’Maw’s beguiling naiveté is dangerous, as it often precedes a feeding frenzy—not for sustenance, but to satisfy its unending curiosity.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/K/KogMaw/KogMaw_0.jpg', '', 73, 68, '2010-06-24', NULL),
('KSante', 'K\'Sante', 'Shurima', 'Fighter', 'the Pride of Nazumah', 'No monster greater than pride.', 'Defiant and courageous, K\'Sante battles colossal beasts and ruthless Ascended to protect his home of Nazumah, a coveted oasis amid the sands of Shurima. But after a falling-out with his former partner, K\'Sante realizes that in order to become a warrior worthy of leading his city, he must temper his single-minded drive for success. Only then can he avoid falling prey to his own pride and find the wisdom he needs to defeat the vicious monsters threatening his people.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/K/KSante/KSante_0.jpg', '', 30, 15, '2022-10-18', NULL),
('LeBlanc', 'LeBlanc', 'Noxus', 'Assassin', 'the Deceiver', 'A rose cannot grow in darkness. It dies, and the darkness grows…', 'Mysterious even to other members of the Black Rose cabal, LeBlanc is but one of many names for a pale woman who has manipulated people and events since the earliest days of Noxus. Using her magic to mirror herself, the sorceress can appear to anyone, anywhere, and even be in many places at once. Always plotting just out of sight, LeBlanc’s true motives are as inscrutable as her shifting identity.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/L/LeBlanc/LeBlanc_0.jpg', '', 50, 10, '2010-11-02', '2025-04-02'),
('LeeSin', 'Lee Sin', 'Ionia', 'Fighter', 'the Blind Monk', 'Enlightenment is knowing the value of one’s ignorance.', 'A master of Ionia\'s ancient martial arts, Lee Sin is a principled fighter who channels the essence of the dragon spirit to face any challenge. Though he lost his sight many years ago, the warrior-monk has devoted his life to protecting his homeland against any who would dare upset its sacred balance. Enemies who underestimate his meditative demeanor will endure his fabled burning fists and blazing roundhouse kicks.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/L/LeeSin/LeeSin_0.jpg', '', 70, 0, '2011-04-01', NULL),
('Leona', 'Leona', 'Targon', 'Tank', 'the Radiant Dawn', 'By the light of the Sun, the world is beheld.', ' Imbued with the fire of the sun, Leona is a holy warrior of the Solari who defends Mount Targon with her Zenith Blade and the Shield of Daybreak. Her skin shimmers with starfire while her eyes burn with the power of the celestial Aspect within her. Armored in gold and bearing a terrible burden of ancient knowledge, Leona brings enlightenment to some, death to others.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/L/Leona/Leona_0.jpg', '', 80, 0, '2011-07-13', NULL),
('Lillia', 'Lillia', 'Ionia', 'Mage', 'the Bashful Bloom', 'When the humans bloom, it’s so beautiful… I can help them! Maybe. Possibly? Perhaps…', 'Intensely shy, the fae fawn Lillia skittishly wanders Ionia’s forests. Hiding just out of sight of mortals—whose mysterious natures have long captivated, but intimidated, her—Lillia hopes to discover why their dreams no longer reach the ancient Dreaming Tree. She now travels Ionia with a magical branch in hand, in an effort to find people’s unrealized dreams. Only then can Lillia herself bloom and help others untangle their fears to find the sparkle within. Eep!', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/L/Lillia/Lillia_0.jpg', '', 45, 21, '2020-07-22', NULL),
('Lissandra', 'Lissandra', 'The_Freljord', 'Mage', 'the Ice Witch', 'So many secrets, buried in ice...', 'As the reclusive leader of the Frostguard, many believe Lissandra is a living saint whose followers bring healing and wisdom to the tribes of the Freljord. The truth is perhaps more sinister, as she uses her elemental magic to twist the power of True Ice into something dark and terrible, entombing or impaling any who would reveal her deepest secrets. Indeed, the legacy of her past may yet be the beginning of the end for Runeterra.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/L/Lissandra/Lissandra_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/1b9c8895ce26e74dca730702c72c6ce05003d8eb.webm', 70, 0, '2013-04-30', NULL),
('Lucian', 'Lucian', 'Runeterra', 'Marksman', 'the Purifier', 'Wield the light, endure the pain, and cleanse all shadow from this world.', 'Lucian, a Sentinel of Light, is a grim hunter of undying spirits, pursuing them relentlessly and annihilating them with his twin relic pistols. After the wraith Thresh slew his wife, Lucian embarked on the path of vengeance—but even with her return to life, his rage is undiminished. Merciless and single-minded, Lucian will stop at nothing to protect the living from the long-dead horrors of the Black Mist.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/L/Lucian/Lucian_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe_live/dc0f76989a923cc4ce7fb6ed294757bdb0be8741.webm', 71, 37, '2013-08-22', NULL),
('Lulu', 'Lulu', 'Bandle_City', 'Support', 'the Fae Sorceress', 'The best path between two points is upside-down, between, then inside-out and round again.', 'The yordle mage Lulu is known for conjuring dreamlike illusions and fanciful creatures as she roams Runeterra with her fairy companion Pix. Lulu shapes reality on a whim, warping the fabric of the world, and what she views as the constraints of this mundane, physical realm. While others might consider her magic at best unnatural, and at worst dangerous, she believes everyone could use a touch of enchantment.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/L/Lulu/Lulu_0.jpg', '', 75, 24, '2012-03-20', NULL),
('Lux', 'Lux', 'Demacia', 'Mage', 'the Lady of Luminosity', 'The light inside is what makes me different, and I’m always careful where I shine it.', 'Luxanna Crownguard hails from Demacia, an insular realm where magical abilities are viewed with fear and suspicion. Able to bend light to her will, she grew up dreading discovery and exile, and was forced to keep her power secret in order to preserve her family’s noble status. Nonetheless, Lux’s optimism and resilience have led her to embrace her unique talents, and she now seeks to bring greater tolerance and understanding to her homeland.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/L/Lux/Lux_0.jpg', '', 66, 7, '2010-10-19', NULL),
('Malphite', 'Malphite', 'Ixtal', 'Tank', 'Shard of the Monolith', 'Beware, minions of chaos! The Shard of the Monolith has come.', 'A massive creature of living stone, Malphite struggles to impose blessed order on a chaotic world. Birthed as a servitor-shard to an otherworldly obelisk known as the Monolith, he used his tremendous elemental strength to maintain and protect his progenitor, but ultimately failed. The only survivor of the destruction that followed, Malphite now endures Runeterra\'s soft folk and their fluid temperaments, while struggling to find a new role worthy of the last of his kind.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/M/Malphite/Malphite_0.jpg', '', 73, 60, '2009-09-02', NULL),
('Malzahar', 'Malzahar', 'The_Void', 'Mage', 'the Prophet of the Void', 'We are timeless. We demand sacrifice.', 'A zealous seer dedicated to the unification of all life, Malzahar truly believes the newly emergent Void to be the path to Runeterra\'s salvation. In the desert wastes of Shurima, he followed the voices that whispered in his mind, all the way to ancient Icathia. Amidst the ruins of that land, he gazed into the dark heart of the Void itself, and was gifted new power and purpose. Malzahar now sees himself as a shepherd, empowered to bring others into the fold… or to release the voidling creatures that dwell beneath.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/M/Malzahar/Malzahar_0.jpg', NULL, 70, 0, '2010-06-01', NULL),
('Maokai', 'Maokai', 'Shadow_Isles', 'Tank', 'the Twisted Treant', 'All around me are empty husks, soulless and unafraid... but I will bring them fear.', 'Maokai is a rageful, towering treant who fights the unnatural horrors of the Shadow Isles. He was twisted into a force of vengeance after a magical cataclysm destroyed his home, surviving undeath only through the Waters of Life infused within his heartwood. Once a peaceful nature spirit, Maokai now furiously battles to banish the scourge of unlife from the Shadow Isles and restore his home to its former beauty.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/M/Maokai/Maokai_0.jpg', '', 65, 20, '2011-02-16', NULL),
('MasterYi', 'Master Yi', 'Ionia', 'Assassin', 'the Wuju Bladesman', 'The edge of the sharpest blade is no match for the calm of the peaceful mind.', 'Master Yi has tempered his body and sharpened his mind, so that thought and action have become almost as one. Though he chooses to enter into violence only as a last resort, the grace and speed of his blade ensures resolution is always swift. As one of the last living practitioners of the Ionian art of Wuju, Yi has devoted his life to continuing the legacy of his people—scrutinizing potential new disciples with the Seven Lenses of Insight to identify the most worthy among them.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/M/MasterYi/MasterYi_0.jpg', '', 90, 0, '2009-02-21', NULL),
('Mel', 'Mel', 'Noxus', 'Mage', 'the Soul\'s Reflection', 'The wolf, the fox–both necessary, both unrelenting.', 'Mel Medarda is the presumed heir of the Medarda family, once one of the most powerful in Noxus. In appearance she is a graceful aristocrat, but beneath the surface lies a skilled politician who makes it her business to know everything about everyone she meets. After an encounter with the mysterious Black Rose, Mel discovered the depths of her mother\'s deception and, for once, faced a situation potentially beyond her control. With newly awakened magical abilities, she sailed home in search of answers—and though many still seek to temper the light within her, Mel\'s soul remains forever defiant.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/M/Mel/Mel_0.jpg', NULL, 37, 12, '2025-01-23', NULL),
('Milio', 'Milio', 'Ixtal', 'Support', 'The Gentle Flame', 'The light inside us, our inner flame... That\'s the heart of my fire.', 'Milio is a warmhearted boy from Ixtal who has, despite his young age, mastered the fire axiom and discovered something new: soothing fire. With this newfound power, Milio plans to help his family escape their exile by joining the Yun Tal—just like his grandmother once did. Having traveled through the Ixtal jungles to the capital of Ixaocan, Milio now prepares to face the Vidalion and join the Yun Tal, unaware of the trials—and dangers—that await him.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/M/Milio/Milio_0.jpg', '', 50, 25, '2023-03-22', NULL),
('MissFortune', 'Miss Fortune', 'Bilgewater', 'Marksman', 'the Bounty Hunter', 'Fortune doesn\'t favor fools.', 'ABilgewater captain famed for her looks but feared for her ruthlessness, Sarah Fortune paints a stark figure among the hardened criminals of the port city. As a child, she witnessed the reaver king Gangplank murder her family—an act she brutally avenged years later, blowing up his flagship while he was still aboard. Those who underestimate her will face a beguiling and unpredictable opponent… and, likely, a bullet or two in their guts.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/M/MissFortune/MissFortune_0.jpg', '', 81, 32, '2010-09-08', NULL),
('Mordekaiser', 'Mordekaiser', 'Noxus', 'Fighter', 'the Iron Revenant', 'Destiny. Domination. Deceit.', 'Twice slain and thrice born, Mordekaiser is a brutal warlord from a foregone epoch who uses his necromantic sorcery to bind souls into an eternity of servitude. Few now remain who remember his earlier conquests, or know the true extent of his powers—but there are some ancient souls that do, and they fear the day when he may return to claim dominion over both the living and the dead.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/M/Mordekaiser/Mordekaiser_0.jpg', NULL, 46, 8, '2010-02-24', NULL),
('Morgana', 'Morgana', 'Demacia', 'Mage', 'The Fallen', 'Only those you love can break your heart.', 'Conflicted between her celestial and mortal natures, Morgana bound her wings to embrace humanity, and inflicts her pain and bitterness upon the dishonest and the corrupt. She rejects laws and traditions she believes are unjust, and fights for truth from the shadows of Demacia—even as others seek to repress it—by casting shields and chains of dark fire. More than anything else, Morgana truly believes that even the banished and outcast may one day rise again.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/M/Morgana/Morgana_0.jpg', '', 80, 30, '2009-02-21', NULL),
('Naafiri', 'Naafiri', 'Shurima', 'Assassin', 'the Hound of a Hundred Bites', 'We track for a thousand years. None can flee for that long.', 'Across the sands of Shurima, a chorus of howls rings out. It is the call of the dune hounds, voracious predators who form packs and compete for the right to hunt in these barren lands. Among them, one pack stands above all, for they are driven not only by canine instincts, but by the ancient power of the Darkin.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/N/Naafiri/Naafiri_0.jpg', NULL, 25, 51, '2023-07-19', NULL),
('Nami', 'Nami', 'Runeterra', 'Support', 'the Tidecaller', 'I decide what the tide will bring.', 'Aheadstrong young vastaya of the seas, Nami was the first of the Marai tribe to leave the waves and venture onto dry land, when their ancient accord with the Targonians was broken. With no other option, she took it upon herself to complete the sacred ritual that would ensure the safety of her people. Amidst the chaos of this new age, Nami faces an uncertain future with grit and determination, using her Tidecaller staff to summon the strength of the oceans themselves.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/N/Nami/Nami_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/eee325cd231728fe0639a9ced9d77532a12db909.webm', 85, 15, '2012-12-07', NULL),
('Nasus', 'Nasus', 'Shurima', 'Fighter', 'the Curator of the Sands', 'For centuries, I have watched. We approach a time of reckoning.', 'Nasus is an imposing, jackal-headed Ascended being from ancient Shurima, a heroic figure regarded as a demigod by the people of the desert. Fiercely intelligent, he was a guardian of knowledge and peerless strategist whose wisdom guided the ancient empire of Shurima to greatness for many centuries. After the fall of the empire, he went into self-imposed exile, becoming little more than a legend. Now that the ancient city of Shurima has risen once more, he has returned, determined to ensure it never falls again.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/N/Nasus/Nasus_0.jpg', NULL, 73, 6, '2009-10-01', NULL),
('Nautilus', 'Nautilus', 'Bilgewater', 'Tank', 'the Titan of the Depths', 'When consumed by utter darkness, there is nothing left but forward.', ' Alonely legend as old as the first piers sunk in Bilgewater, the armored goliath known as Nautilus roams the dark waters off the coast of the Blue Flame Isles. Driven by a forgotten betrayal, he strikes without warning, swinging his enormous anchor to save the wretched, and drag the greedy to their doom. It is said he comes for those who forget to pay the “Bilgewater tithe”, pulling them down beneath the waves with him—an iron-clad reminder that none can escape the depths.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/N/Nautilus/Nautilus_0.jpg', '', 83, 1, '2012-02-14', NULL),
('Neeko', 'Neeko', 'Ixtal', 'Mage', 'the Curious Chameleon', 'The Oovi-Kat are gone. Neeko must build her own tribe, now.', 'Hailing from a long lost tribe of vastaya, Neeko can blend into any crowd by borrowing the appearances of others, even absorbing something of their emotional state to tell friend from foe in an instant. No one is ever sure where—or who—Neeko might be, but those who intend to do her harm will soon witness her true colors revealed, and feel the full power of her primordial spirit magic unleashed upon them.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/N/Neeko/Neeko_0.jpg', '', 44, 0, '2018-11-21', NULL),
('Nidalee', 'Nidalee', 'Ixtal', 'Mage', 'the Bestial Huntress', 'The untamed know no fear.', 'Raised in the deepest wilderness, Nidalee is a master tracker who can shapeshift into a ferocious pakaa jungle cat at will. Neither wholly woman nor beast, she viciously defends her territory from any and all trespassers, with carefully placed traps and deft spear throws. She cripples her quarry before pouncing on them in feline form—the lucky few who survive tell tales of a wild woman with razor-sharp instincts, and even sharper claws...', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/N/Nidalee/Nidalee_0.jpg', '', 84, 2, '2009-12-17', NULL),
('Nilah', 'Nilah', 'Bilgewater', 'Marksman', 'the Joy Unbound', 'Bliss in life, and bliss forever after.', 'Nilah is an ascetic warrior from a distant land, seeking the world’s deadliest, most titanic opponents so that she might challenge and destroy them. Having won her power through an encounter with the long-imprisoned demon of joy, she has no emotions other than unceasing jubilation—a small price to pay for the vast strength she now possesses. Channeling the demon’s liquid form into a blade of unparalleled might, she stands defiant against ancient threats long forgotten.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/N/Nilah/Nilah_0.jpg', '', 68, 28, '2022-08-11', NULL),
('Nocturne', 'Nocturne', 'Runeterra', 'Assassin', 'the Eternal Nightmare', 'The darkness is closing in...', 'A demonic amalgamation drawn from the nightmares that haunt every sentient mind, the thing known as Nocturne has become a primordial force of pure evil. It is liquidly chaotic in aspect, a faceless shadow with cold eyes and armed with wicked-looking blades. After freeing itself from the spirit realm, Nocturne descended upon the waking world, to feed upon the kind of terror that can only thrive in true darkness.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/N/Nocturne/Nocturne_0.jpg', '', 65, 30, '2011-03-15', NULL),
('Nunu', 'Nunu', 'The_Freljord', 'Tank', 'the Boy and His Yeti', 'Pull the fur outta your earholes, Willump! This is gonna be the bestest story ever!', 'Once upon a time, there was a boy who wanted to prove he was a hero by slaying a fearsome monster—only to discover that the beast, a lonely and magical yeti, merely needed a friend. Bound together by ancient power and a shared love of snowballs, Nunu and Willump now ramble wildly across the Freljord, breathing life into imagined adventures. They hope that somewhere out there, they will find Nunu\'s mother. If they can save her, maybe they will be heroes after all…', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/N/Nunu/Nunu_0.jpg', NULL, 69, 63, '2009-02-21', NULL),
('Olaf', 'Olaf', 'The_Freljord', 'Fighter', NULL, 'When you meet your ancestors, tell them Olaf sent you.', 'An unstoppable force of destruction, the axe-wielding Olaf wants nothing but to die in glorious combat. Hailing from the brutal Freljordian peninsula of Lokfar, he once received a prophecy foretelling his peaceful passing—a coward\'s fate, and a great insult among his people. Seeking death, and fueled by rage, he rampaged across the land, slaughtering scores of great warriors and legendary beasts in search of any opponent who could stop him. Now a brutal enforcer for the Winter\'s Claw, he seeks his end in the great wars to come.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/O/Olaf/Olaf_0.jpg', NULL, 67, 9, '2010-06-09', NULL),
('Orianna', 'Orianna', 'Piltover', 'Mage', 'the Lady of Clockwork', 'When a moth emerges from its chrysalis, does it remember its life as a caterpillar?', 'Once a curious girl of flesh and blood, Orianna is now a technological marvel composed entirely of clockwork. She became gravely ill after an accident in the lower districts of Zaun, and her failing body had to be replaced with exquisite artifice, piece by piece. Accompanied by the extraordinary brass orb that houses her hextech arsenal, Orianna is now free to explore the wonders of Piltover, and beyond.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/O/Orianna/Orianna_0.jpg', '', 80, 0, '2011-06-01', NULL),
('Ornn', 'Ornn', 'The_Freljord', 'Tank', 'The Fire below the Mountain', 'I have said enough.', 'Ornn is the Freljordian spirit of forging and craftsmanship. He works in the solitude of a massive smithy, hammered out from the lava caverns beneath the volcano Hearth-Home. There he stokes bubbling cauldrons of molten rock to purify ores and fashion items of unsurpassed quality. When other deities—especially Volibear—walk the earth and meddle in mortal affairs, Ornn arises to put these impetuous beings back in their place, either with his trusty hammer or the fiery power of the mountains themselves.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/O/Ornn/Ornn_0.jpg', NULL, 49, 30, '2017-08-23', NULL),
('Pantheon', 'Pantheon', 'Targon', 'Fighter', 'the Unbreakable Spear', 'Here is my eternity… a day the gods will remember!', 'Once an unwilling host to the Aspect of War, Atreus survived when the celestial power within him was slain, refusing to succumb to a blow that tore stars from the heavens. In time, he learned to embrace the power of his own mortality, and the stubborn resilience that goes along with it. Atreus now opposes the divine as Pantheon reborn, his unbreakable will fueling the fallen Aspect\'s weapons on the field of battle.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/P/Pantheon/Pantheon_0.jpg', '', 51, 25, '2010-02-02', NULL),
('Poppy', 'Poppy', 'Demacia', 'Tank', 'Keeper of the Hammer', 'I’m no hero. Just a yordle with a hammer.', 'Runeterra has no shortage of valiant champions, but few are as tenacious as Poppy. Bearing the legendary hammer of Orlon, a weapon twice her size, this determined yordle has spent untold years searching in secret for the fabled “Hero of Demacia,” said to be its rightful wielder. Until then, she dutifully charges into battle, pushing back the kingdom\'s enemies with every whirling strike.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/P/Poppy/Poppy_0.jpg', NULL, 72, 0, '2011-05-10', NULL),
('Pyke', 'Pyke', 'Bilgewater', 'Assassin', 'the Bloodharbor Ripper', 'There’s plenty of room for everyone at the bottom of the sea...', 'A renowned harpooner from the slaughter docks of Bilgewater, Pyke should have met his death in the belly of a gigantic jaull-fish… and yet, he returned. Now, stalking the dank alleys and backways of his former hometown, he uses his new supernatural gifts to bring a swift and gruesome end to those who make their fortune by exploiting others—and a city that prides itself on hunting monsters now finds a monster hunting them.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/P/Pyke/Pyke_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/282d238345547cda81281506f0ea7b0ba1d1c20e.webm', 49, 22, '2018-05-31', NULL),
('Qiyana', 'Qiyana', 'Ixtal', 'Assassin', 'The Empress of Elements', 'Some day, all this will be Ixaocan. A glorious empire, with an empress to fit.', 'In the jungle city of Ixaocan, Qiyana plots her own ruthless path to the high seat of the Yun Tal. Last in line to succeed her parents, she faces those who stand in her way with brash confidence and unprecedented mastery over elemental magic. With the land itself obeying her every command, Qiyana sees herself as the greatest elementalist in the history of Ixaocan—and by that right, deserving of not only a city, but an empire.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/Q/Qiyana/Qiyana_0.jpg', '', 51, 23, '2019-07-17', NULL),
('Quinn', 'Quinn', 'Demacia', 'Marksman', 'Demacia\'s Wings', 'Most soldiers only rely on their weapons. Few truly rely on each other.', ' Sponsored by the noble Buvelle family, Quinn is a ranger-knight of Demacia who undertakes dangerous missions deep in enemy territory. She and her legendary eagle, Valor, share an unbreakable bond, and their foes are often slain before they realize they are fighting not one, but two of the kingdom’s greatest heroes. Nimble and acrobatic, Quinn takes aim with her crossbow while Valor marks their elusive targets from above, making them a deadly pair on the battlefield.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/Q/Quinn/Quinn_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/183765feb69482fa1ff8c0a752ddfe22030084c5.webm', 66, 0, '2013-07-30', NULL),
('Rakan', 'Rakan', 'Ionia', 'Support', 'the Charmer', 'Why do you never say yes?', ' As mercurial as he is charming, Rakan is an infamous vastayan troublemaker and the greatest battle-dancer in Lhotlan tribal history. To the humans of the Ionian highlands, his name had long been synonymous with wild festivals, uncontrollable parties, and anarchic music. But this energetic, traveling showman has left his old life behind, dedicating himself to the cause of his lover, the rebel Xayah. Together, they seek to free Ionia’s wild magic, restoring the vastaya’s birthright.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/R/Rakan_Xayah/Rakan_Xayah_0.jpg', '', 41, 10, '2017-09-27', NULL),
('Rammus', 'Rammus', 'Shurima', 'Tank', 'the Armordillo', 'OK.', 'Idolized by many, dismissed by some, mystifying to all, the curious being Rammus is an enigma. Protected by a spiked shell, he inspires increasingly disparate theories on his origin wherever he goes—from demigod, to sacred oracle, to a mere beast transformed by magic. Whatever the truth may be, Rammus keeps his own counsel and stops for no one as he roams the Shuriman desert.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/R/Rammus/Rammus_0.jpg', NULL, 64, 29, '2011-08-01', NULL),
('RekSai', 'Rek\'Sai', 'The_Void', 'Fighter', 'the Void Burrower', 'Fear not ambush from the hills, nor winged beasts from the skies. The true terror of Shurima comes from the sand, and gives no warning of her presence.', 'An apex predator, Rek\'Sai is a merciless Void-spawn that tunnels beneath the ground to ambush and devour unsuspecting prey. Her insatiable hunger has laid waste to entire regions of the once-great empire of Shurima—merchants, traders, even armed caravans, will go hundreds of miles out of their way to avoid her and her offspring\'s hunting grounds. All know that once Rek\'Sai is seen on the horizon, death from below is all but guaranteed.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/R/RekSai/RekSai_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/527c81674b4c59fa77850d30a23811f37d6ddcc8.webm', 55, 33, '2014-10-27', NULL),
('Rell', 'Rell', 'Noxus', 'Support', 'the Iron Maiden', 'Forge your heart into something strong. Unbreakable.', ' The product of brutal experimentation at the hands of the Black Rose, Rell is a defiant, living weapon determined to topple Noxus. Her childhood was one of misery and horror, enduring unspeakable procedures to perfect and weaponize her magical control over metal... until she made a violent escape, killing many of her captors in the process. Now branded as a criminal, Rell attacks Noxian soldiers on sight as she searches for survivors of her old “academy”, defending the meek while delivering merciless death to her former instructors.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/R/Rell/Rell_0.jpg', '', 49, 13, '2020-10-28', NULL),
('RenataGlasc', 'Renata Glasc', 'Zaun', 'Support', 'the Chem-Baroness', 'We don\'t have to be enemies. Let me change your mind.', 'Renata Glasc rose from the ashes of her childhood home with nothing but her name and her parents’ alchemical research. In the decades since, she has become Zaun’s wealthiest chem-baron, a business magnate who built her power by tying everyone’s interests to her own. Work with her, and be rewarded beyond measure. Work against her, and live to regret it. But everyone comes to her side, eventually.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/R/RenataGlasc/RenataGlasc_0.jpg', '', 54, 14, '2022-02-17', NULL),
('Renekton', 'Renekton', 'Shurima', 'Fighter', 'the Butcher of the Sands', 'Blood! And vengeance!', 'Renekton is a terrifying, rage-fueled Ascended being from the scorched deserts of Shurima. Once, he was his empire\'s most esteemed warrior, leading the nation\'s armies to countless victories. However, after the empire\'s fall, Renekton was entombed beneath the sands, and slowly, as the world turned and changed, he succumbed to insanity. Now free once more, he is utterly consumed with finding and killing his brother, Nasus, who he blames, in his madness, for the centuries he spent in darkness.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/R/Renekton/Renekton_0.jpg', NULL, 66, 1, '2011-07-27', NULL),
('Rengar', 'Rengar', 'Ixtal', 'Assassin', 'the Pridestalker', 'Prey on the weak and you may survive. Prey on the strong and you will truly live.', 'Rengar is a ferocious vastayan trophy hunter who lives for the thrill of tracking down and killing dangerous creatures. He scours the world for the most fearsome beasts he can find, especially seeking any trace of Kha’Zix, the void creature who scratched out his eye. Rengar stalks his prey neither for food nor glory, but for the sheer beauty of the pursuit.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/R/Rengar/Rengar_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/1d6b5b19b0a0c99fae110db5a04aa46ff3b29baf.webm', 74, 20, '2012-02-01', NULL),
('Riven', 'Riven', 'Noxus', 'Fighter', 'the Exile', 'A warrior’s blade reflects the truth in their heart. Mine is black, and broken.', 'Once a swordmaster in the warhosts of Noxus, Riven rose through the ranks on the strength of her conviction and brutal efficiency, and was rewarded with a legendary runic blade and a warband of her own. However, on the Ionian front, Riven’s faith in her nation was tested and ultimately broken. She severed all ties to the empire, seeking to find her place in a shattered world, even as rumors abounded that Noxus had been reforged. Now forced to return in chains, she faces the judgment of her former homeland...', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/R/Riven/Riven_0.jpg', '', 86, 0, '2010-10-07', NULL),
('Rumble', 'Rumble', 'Bandle_City', 'Fighter', 'the Mechanized Menace', 'Ugh, it\'s gonna take forever to scrape your face off my suit!', 'Rumble is a young inventor with a temper. Using nothing more than his own two hands and a heap of scrap, the feisty yordle constructed a colossal mech suit outfitted with an arsenal of electrified harpoons and incendiary rockets. Though others may scoff and sneer at his junkyard creations, Rumble doesn\'t mind—after all, he\'s the one with the flamespitter.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/R/Rumble/Rumble_0.jpg', '', 70, 1, '2011-01-18', NULL),
('Ryze', 'Ryze', 'Runeterra', 'Mage', 'the Rune Mage', 'Take care with this world. What is made can be unmade.', 'Widely considered one of the most adept sorcerers on Runeterra, Ryze is an ancient, hard-bitten archmage with an impossibly heavy burden to bear. Armed with immense arcane power and a boundless constitution, he tirelessly hunts for World Runes—fragments of the raw magic that once shaped the world from nothingness. He must retrieve these artifacts before they fall into the wrong hands, for Ryze understands the horrors they could unleash on Runeterra.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/R/Ryze/Ryze_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/89a2df2d61fe7a417e3b7841d2cefc40e46d8773.webm', 84, 35, '2012-11-21', NULL),
('Samira', 'Samira', 'Noxus', 'Marksman', 'the Desert Rose', 'Virtues, I\'ve got a few. Vices, a few more.', ' Samira stares death in the eye with unyielding confidence, seeking thrill wherever she goes. After her Shuriman home was destroyed as a child, Samira found her true calling in Noxus, where she built a reputation as a stylish daredevil taking on dangerous missions of the highest caliber. Wielding black-powder pistols and a custom-engineered blade, Samira thrives in life-or-death circumstances, eliminating any who stand in her way with flash and flair.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Samira/Samira_0.jpg', '', 59, 2, '2020-08-27', NULL),
('Sejuani', 'Sejuani', 'The_Freljord', 'Tank', 'the Winter\'s Wrath', 'I was cut from the ice. Shaped by the storms. Hardened in the cold.', 'Sejuani is the brutal, unforgiving Warmother of the Winter’s Claw, one of the most feared tribes of the Freljord. Her people’s survival is a constant, desperate battle against the elements, forcing them to raid Noxians, Demacians, and Avarosans alike to survive the harsh winters. Sejuani herself spearheads the most dangerous of these attacks from the saddle of her drüvask boar Bristle, using her True Ice flail to freeze and shatter her enemies.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Sejuani/Sejuani_0.jpg', '', 61, 0, '2013-06-18', NULL),
('Senna', 'Senna', 'Runeterra', 'Support', 'the Redeemer', 'As shadows embrace the light, I will embrace them...', 'Cursed from childhood to be haunted by the supernatural Black Mist, Senna joined a sacred order known as the Sentinels of Light, and fiercely fought back—only to be killed, her soul imprisoned in a lantern by the cruel wraith Thresh. But refusing to lose hope, within the lantern Senna learned to use the Mist, and reemerged to new life, forever changed. Now wielding darkness along with light, Senna seeks to end the Black Mist by turning it against itself—with every blast of her relic weapon, redeeming the souls lost within.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Senna/Senna_0.jpg', '', 58, 11, '2019-10-15', NULL),
('Seraphine', 'Seraphine', 'Piltover', 'Support', 'the Starry-Eyed Songstress', 'This one’s for you!', 'Born in Piltover to Zaunite parents, Seraphine can hear the souls of others—the world sings to her, and she sings back. Though these sounds overwhelmed her in her youth, she now draws on them for inspiration, turning the chaos into a symphony. She performs for the sister cities to remind their citizens that they’re not alone, that they’re stronger together, and that, in her eyes, their potential is limitless.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Seraphine/Seraphine_0.jpg', '', 42, 19, '2020-10-29', NULL),
('Sett', 'Sett', 'Ionia', 'Fighter', 'the Boss', 'The boss is here. Hold your applause... seriously, be quiet.', ' Aleader of Ionia’s growing criminal underworld, Sett rose to prominence in the wake of the war with Noxus. Though he began as a humble challenger in the fighting pits of Navori, he quickly gained notoriety for his savage strength, and his ability to take seemingly endless amounts of punishment. Now, having climbed through the ranks of local combatants, Sett has muscled to the top, reigning over the pits he once fought in.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Sett/Sett_0.jpg', '', 49, 9, '2020-01-14', NULL),
('Shaco', 'Shaco', 'Runeterra', 'Assassin', 'the Demon Jester', 'Whatever you do, don\'t tell him you missed the punch line.', 'Crafted long ago as a plaything for a lonely prince, the enchanted marionette Shaco now delights in murder and mayhem. Corrupted by dark magic and the loss of his beloved charge, the once-kind puppet finds pleasure only in the misery of the poor souls he torments. He uses toys and simple tricks to deadly effect, finding the results of his bloody “games” hilarious—and for those who hear a dark chuckle in the dead of night, the Demon Jester may have marked them as his next plaything.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Shaco/Shaco_0.jpg', '', 75, 1, '2014-03-19', NULL),
('Shen', 'Shen', 'Ionia', 'Tank', 'the Eye of Twilight', 'The Eye is blind to fear, to hate, to love – to all things that would sway equilibrium.', 'Among the secretive, Ionian warriors known as the Kinkou, Shen serves as their leader, the Eye of Twilight. He longs to remain free from the confusion of emotion, prejudice, and ego, and walks the unseen path of dispassionate judgment between the spirit realm and the physical world. Tasked with enforcing the equilibrium between them, Shen wields blades of steel and arcane energy against any who would threaten it.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Shen/Shen_0.jpg', NULL, 85, 0, '2010-08-01', NULL),
('Shyvana', 'Shyvana', 'Demacia', 'Fighter', 'the Half-Dragon', 'I am of two worlds, yet I belong to neither.', ' Shyvana is a creature with pure elemental magic blazing in her heart. Though she most often appears humanoid, she can take her true form when necessary—that of a fearsome dragon, incinerating her foes with fiery breath. Having saved the life of the crown prince Jarvan IV, Shyvana now serves uneasily in his royal guard, struggling to find acceptance among the suspicious people of Demacia.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Shyvana/Shyvana_0.jpg', '', 78, 0, '2011-11-01', NULL),
('Singed', 'Singed', 'Zaun', 'Tank', 'the Mad Chemist', 'You mustn’t die yet; I have far too much to learn from your fragile anatomy.', 'Singed is a brilliant alchemist of dubious morality, whose experiments would turn the stomach of even the most cutthroat criminal. Selling his skills to the highest bidder, he cares little for how his noxious concoctions are used, with the ensuing chaos an experiment in itself. His most infamous work is “shimmer”, which enabled the chembarons to turn Zaun into their personal playground—but fueled by madness, Singed is always working on something new, with each endeavor more depraved than the last...', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Singed/Singed_0.jpg', NULL, 78, 1, '2009-04-18', NULL),
('Sion', 'Sion', 'Noxus', 'Tank', 'The Undead Juggernaut', 'War is eternal... as am I.', 'A war hero from a bygone era, Sion was revered in Noxus for choking the life out of a Demacian king with his bare hands—but, denied oblivion, he was resurrected to serve his empire even in death. His indiscriminate slaughter claimed all who stood in his way, regardless of allegiance, proving he no longer retained his former humanity. Even so, with crude armor bolted onto rotten flesh, Sion continues to charge into battle with reckless abandon, struggling to remember his true self between the swings of his mighty axe.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Sion/Sion_0.jpg', NULL, 78, 1, '2016-11-21', NULL),
('Sivir', 'Sivir', 'Shurima', 'Marksman', 'the Battle Mistress', 'Coin may buy you skill for a day, but never loyalty.', 'Sivir is a renowned mercenary captain who plies her trade in the deserts of Shurima. Armed with her legendary jeweled crossblade, she has fought and won countless battles for those who can afford her services, and prides herself on recovering lost treasures from the catacombs beneath the old empire—for a generous share of the profits, of course. With ancient forces stirring the very bones of Shurima, Sivir now finds herself torn between conflicting destinies…', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Sivir/Sivir_0.jpg', '', 61, 15, '2015-06-03', NULL),
('Skarner', 'Skarner', 'Ixtal', 'Tank', 'the Primordial Sovereign', 'I may have faded into legend—but I am no mere story.', 'The ancient, colossal brackern Skarner is revered in Ixtal as one of the founding members of its ruling caste, the Yun Tal. Devoted to keeping his nation safe from the rest of the world, Skarner dwells in a chamber beneath Ixaocan where he can hear the vibrations of the earth and detect potential threats. As more members of the Yun Tal begin questioning Ixtal\'s self-isolation, Skarner grows increasingly paranoid and will do anything to keep Ixtal and its people safe—no matter the cost.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Skarner/Skarner_0.jpg', NULL, 49, 84, '2012-07-11', '2024-04-03'),
('Smolder', 'Smolder', 'Runeterra', 'Marksman', 'the Fiery Fledgling', 'Imperial dragons are the best dragons. My mom says so.', 'Hidden amongst the craggy cliffs of the Noxian frontier, under the watchful eyes of his mother, a young dragon is learning what it means to be heir to the Camavoran imperial dragon lineage. Playful and eager to grow up, Smolder looks for any excuse to practice his burgeoning abilities. Though he\'s still a fledgling, his skills are nothing to sneeze at, easily setting fire to anything that burns.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Smolder/Smolder_0.jpg', '', 44, 30, '2024-03-20', NULL),
('Sona', 'Sona', 'Demacia', 'Support', 'Maven of the Strings', 'What masterpiece shall we play today?', 'Sona is a virtuoso of the stringed etwahl, speaking only through her graceful chords and vibrant arias. Her genteel manner has endeared her to the Demacian nobility, though some speculate her arresting melodies actually emanate magic—a dangerous prospect in the kingdom. Silent to outsiders but understood easily enough by close companions, Sona plucks her harmonies not only to soothe injured allies, but also to strike down unsuspecting enemies.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Sona/Sona_0.jpg', '', 77, 0, '2010-09-21', NULL),
('Soraka', 'Soraka', 'Targon', 'Support', 'the Starchild', 'Two paths lie before you, but you can only take one.', ' Awanderer from the celestial realm, Soraka gave up her immortal form to protect the mortal races from their own ignorance and violent instincts. She endeavors to spread the virtues of compassion and mercy to everyone she meets—guiding the lost, and healing the wounded. For all Soraka has seen of this world\'s struggles, she still believes the people of Runeterra have yet to reach their full potential.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Soraka/Soraka_0.jpg', '', 57, 0, '2009-02-21', NULL),
('Swain', 'Swain', 'Noxus', 'Mage', 'the Noxian Grand General', 'I have learned enough to detest all men. Only nations may be revered.', 'Jericho Swain is the visionary ruler of Noxus, an expansionist nation that reveres only strength. Though he was cast down and crippled in the Ionian wars, his left arm severed, he seized control of the empire with ruthless determination… and a new, demonic hand. Now, Swain commands from the front lines, marching against a coming darkness that only he can see—in glimpses gathered by shadowy ravens from the corpses all around him. In a swirl of sacrifice and secrets, the greatest secret of all is that the true enemy lies within.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Swain/Swain_0.jpg', '', 70, 0, '2010-10-19', NULL),
('Sylas', 'Sylas', 'Demacia', 'Mage', 'the Unshackled', 'I am no traitor. I am the true Demacia.', 'Raised in one of Demacia’s lesser quarters, Sylas of Dregbourne has come to symbolize the darker side of the Great City. As a boy, his ability to root out hidden sorcery caught the attention of the notorious mageseekers, who eventually imprisoned him for turning those same powers against them. Having now broken free, Sylas lives as a hardened revolutionary, using the magic of those around him to destroy the kingdom he once served… and his band of outcast mage followers seems to grow by the day.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Sylas/Sylas_0.jpg', NULL, 51, 10, '2019-01-24', NULL),
('Syndra', 'Syndra', 'Ionia', 'Mage', 'the Dark Sovereign', 'My potential is limitless. I will not be restrained.', ' Syndra is a fearsome Ionian mage with incredible power at her command. As a child, she disturbed the village elders with her reckless and wild magic. She was sent away to be taught greater control, but eventually discovered her supposed mentor was restraining her abilities. Forming her feelings of betrayal and hurt into dark spheres of energy, Syndra has sworn to destroy all who would try to control her.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/S/Syndra/Syndra_0.jpg', '', 50, 10, '2012-09-13', NULL),
('TahmKench', 'Tahm Kench', 'Runeterra', 'Tank', 'the River King', 'The whole world\'s a river, and I\'m its king.', ' Known by many names throughout history, the demon Tahm Kench travels the waterways of Runeterra, feeding his insatiable appetite with the misery of others. Though he may appear singularly charming and proud, he swaggers through the physical realm like a vagabond in search of unsuspecting prey. His lashing tongue can stun even a heavily armored warrior from a dozen paces, and to fall into his rumbling belly is to tumble into an abyss from which there is little hope of return.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/T/TahmKench/TahmKench_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/880b15d0864666f1e5876c445b0001ec5e46cc89.webm', 84, 47, '2015-07-22', NULL),
('Taliyah', 'Taliyah', 'Shurima', 'Mage', 'the Stoneweaver', 'This world is a tapestry of our own making.', 'Taliyah is a nomadic mage from Shurima, torn between teenage wonder and adult responsibility. She has crossed nearly all of Valoran on a journey to learn the true nature of her growing powers, though more recently she has returned to protect her tribe. Some have mistaken her compassion for weakness and paid the ultimate price—for beneath Taliyah’s youthful demeanor is a will strong enough to move mountains, and a spirit fierce enough to make the earth itself tremble.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/T/Taliyah/Taliyah_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/05cbd428b79d72c57fbbffe976461eb66e23af40.webm', 87, 0, '2016-05-18', NULL);
INSERT INTO `champions` (`id`, `name`, `region`, `role`, `title`, `voice`, `story`, `splash_art`, `animated_splash_art`, `position_x`, `position_y`, `release_date`, `updated_date`) VALUES
('Talon', 'Talon', 'Noxus', 'Assassin', 'the Blade\'s Shadow', 'The three deadliest blademasters in all of Valoran are bound to the house of Du Couteau: my father, myself, and Talon. Challenge us, if you dare.', 'Talon is the knife in the darkness, a merciless killer able to strike without warning and escape before any alarm is raised. He carved out a dangerous reputation on the brutal streets of Noxus, where he was forced to fight, kill, and steal to survive. Adopted by the notorious Du Couteau family, he now plies his deadly trade at the empire\'s command, assassinating enemy leaders, captains, and heroes… as well as any Noxian foolish enough to earn the scorn of their masters.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/T/Talon/Talon_0.jpg', NULL, 73, 17, '2011-08-24', NULL),
('Taric', 'Taric', 'Targon', 'Support', 'the Shield of Valoran', 'The best weapons are beautiful.', 'Taric is the Aspect of the Protector, wielding incredible power as Runeterra\'s guardian of life, love, and beauty. Shamed by a dereliction of duty and exiled from his homeland Demacia, Taric ascended Mount Targon to find redemption, only to discover a higher calling among the stars. Imbued with the might of ancient Targon, the Shield of Valoran now stands ever vigilant against the insidious corruption of the Void.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/T/Taric/Taric_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/1037e8b68c585017cfd79b8b96198010097f36a5.webm', 87, 6, '2009-02-21', NULL),
('Teemo', 'Teemo', 'Bandle_City', 'Mage', 'the Swift Scout', 'Bandle Scout Teemo, reporting for duty!', 'Undeterred by even the most dangerous and threatening of obstacles, Teemo scouts the world with boundless enthusiasm and a cheerful spirit. A yordle with an unwavering sense of morality, he takes pride in following the Bandle Scout\'s Code, sometimes with such eagerness that he is unaware of the broader consequences of his actions. Though some say the existence of the Scouts is questionable, one thing is for certain: Teemo\'s conviction is nothing to be trifled with.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/T/Teemo/Teemo_0.jpg', NULL, 56, 13, '2009-02-21', '2024-10-09'),
('Thresh', 'Thresh', 'Shadow_Isles', 'Support', 'the Chain Warden', 'The mind is a wondrous thing to tear apart.', 'Sadistic and cunning, Thresh is an ambitious and restless spirit of the Shadow Isles. Once the custodian of countless arcane secrets, he was undone by a power greater than life or death, and now sustains himself by tormenting and breaking others with slow, excruciating inventiveness. His victims suffer far beyond their brief mortal coil as Thresh wreaks agony upon their souls, imprisoning them in his unholy lantern to torture for all eternity.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/T/Thresh/Thresh_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe_live/7f9303b9a6190c4981e858203470010d9744d3fe.webm', 69, 0, '2013-01-23', NULL),
('Tristana', 'Tristana', 'Bandle_City', 'Marksman', 'the Yordle Gunner', 'Boomer says hi.', 'While many other yordles channel their energy into discovery, invention, or just plain mischief-making, Tristana was always inspired by the adventures of great warriors. She had heard much about Runeterra, its factions, and its wars, and believed her kind could become worthy of legend too. Setting foot in the world for the first time, she took up her trusty cannon Boomer, and now leaps into battle with steadfast courage and optimism.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/T/Tristana/Tristana_0.jpg', '', 67, 4, '2011-03-01', NULL),
('Trundle', 'Trundle', 'The_Freljord', 'Fighter', 'the Troll King', 'Outsmart anyone you can\'t beat, and beat anyone you can\'t outsmart.', 'Trundle is a hulking and devious troll with a particularly vicious streak, and there is nothing he cannot bludgeon into submission—not even the Freljord itself. Fiercely territorial, he chases down anyone foolish enough to enter his domain. Then, his massive club of True Ice at the ready, he chills his enemies to the bone and impales them with jagged, frozen pillars, laughing as they bleed out onto the tundra.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/T/Trundle/Trundle_0.jpg', '', 56, 7, '2010-11-30', NULL),
('Tryndamere', 'Tryndamere', 'The_Freljord', 'Fighter', 'the Barbarian King', 'Rage is my weapon.', 'Fueled by unbridled fury and rage, Tryndamere once carved his way through the Freljord, openly challenging the greatest warriors of the north to prepare himself for even darker days ahead. The wrathful barbarian has long sought revenge for the annihilation of his clan, though more recently he has found companionship with Ashe, the Avarosan warmother, and a home with her people. His almost inhuman strength and fortitude is legendary, and has delivered him and his new allies countless victories against the greatest of odds.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/T/Tryndamere/Tryndamere_0.jpg', NULL, 77, 0, '2012-05-01', NULL),
('TwistedFate', 'Twisted Fate', 'Bilgewater', 'Mage', 'the Card Master', 'It\'s not gambling if you can\'t lose...', 'Twisted Fate is an infamous cardsharp and swindler who has gambled and charmed his way across much of the known world, earning the enmity and admiration of the rich and foolish alike. He rarely takes things seriously, greeting each day with a mocking smile and an insouciant swagger. In every possible way, Twisted Fate always has an ace up his sleeve.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/T/TwistedFate/TwistedFate_0.jpg', NULL, 83, 5, '2009-02-21', NULL),
('Twitch', 'Twitch', 'Zaun', 'Marksman', 'the Plague Rat', 'They threw this away? But it’s so shiny!', 'A Zaunite plague rat by birth, but a connoisseur of filth by passion, Twitch is not afraid to get his paws dirty. Aiming a chem-powered crossbow at the gilded heart of Piltover, he has vowed to show those in the city above just how filthy they really are. Always a sneaky sneak, when he\'s not rooting around in the Sump, he\'s digging deep into other people\'s garbage for discarded treasures… and perhaps a moldy sandwich.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/T/Twitch/Twitch_0.jpg', NULL, 63, 27, '2009-05-01', NULL),
('Udyr', 'Udyr', 'The_Freljord', 'Fighter', 'the Spirit Walker', 'the Spirit Walker', 'The most powerful spirit walker alive, Udyr communes with all the spirits of the Freljord, whether by empathically understanding their needs, or by channeling and transforming their ethereal energy into his own primal fighting style. He seeks balance within, so that his mind does not get lost amidst others, but he also seeks balance without—for the Freljord\'s mystical landscape can only thrive with the growth that comes from conflict and struggle, and Udyr knows that sacrifices must be made to keep peaceful stagnance at bay.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/U/Udyr/Udyr_0.jpg', '', 53, 0, '2009-12-02', NULL),
('Urgot', 'Urgot', 'Zaun', 'Fighter', 'the Dreadnought', 'There is only one way to measure a man. Tear him… into… pieces.', 'Once a powerful Noxian headsman, Urgot was betrayed by the empire for which he had killed so many. Bound in iron chains, he was forced to learn the true meaning of strength in the Dredge—a prison mine deep beneath Zaun. Emerging in a disaster that spread chaos throughout the city, he now casts an imposing shadow over its criminal underworld. Raising his victims on the very chains that once enslaved him, he will purge his new home of the unworthy, making it a crucible of pain.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/U//Urgot/Urgot_0.jpg', NULL, 56, 6, '2010-03-10', NULL),
('Varus', 'Varus', 'Ionia', 'Marksman', 'the Arrow of Retribution', 'You didn’t destroy us all. And that mistake will be your undoing.', 'One of the ancient darkin, Varus was a deadly killer who loved to torment his foes, driving them almost to insanity before delivering the killing arrow. He was imprisoned at the end of the Great Darkin War, but escaped centuries later in the remade flesh of two Ionian hunters—they had unwittingly released him, cursed to bear the bow containing his bound essence. Varus now seeks out those who trapped him, in order to enact his brutal vengeance, but the mortal souls within still resist him every step of the way.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/V/Varus/Varus_0.jpg', NULL, 54, 0, '2012-06-01', NULL),
('Vayne', 'Vayne', 'Demacia', 'Marksman', 'the Night Hunter', 'I don’t kill creatures like you because it’s the right thing to do. I kill you because I enjoy it.', 'Shauna Vayne is a deadly, remorseless Demacian monster hunter, who has dedicated her life to finding and destroying the demon that murdered her family. Armed with a wrist-mounted crossbow and a heart full of vengeance, she is only truly happy when slaying practitioners or creations of the dark arts, striking from the shadows with a flurry of silver bolts.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/V/Vayne/Vayne_0.jpg', '', 92, 11, '2011-06-27', NULL),
('Veigar', 'Veigar', 'Bandle_City', 'Mage', 'the Tiny Master of Evil', 'You deny the darkness in your soul...', 'An enthusiastic master of dark sorcery, Veigar has embraced powers that few mortals dare approach. As a free-spirited inhabitant of Bandle City, he longed to push beyond the limitations of yordle magic, and turned instead to arcane texts that had been hidden away for thousands of years. Now a stubborn creature with an endless fascination for the mysteries of the universe, Veigar is often underestimated by others—but even though he believes himself truly evil, he possesses an inner morality that leads some to question his deeper motivations.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/V/Veigar/Veigar_0.jpg', NULL, 71, 10, '2009-07-24', NULL),
('VelKoz', 'Vel\'Koz', 'The_Void', 'Mage', 'the Eye of the Void', 'Only by deconstruction is truth revealed.', 'It is unclear if Vel\'Koz was the first Void-spawn to emerge on Runeterra, but there has certainly never been another to match his level of cruel, calculating sentience. While his kin devour or defile everything around them, he seeks instead to scrutinize and study the physical realm—and the strange, warlike beings that dwell there—for any weakness the Void might exploit. But Vel\'Koz is far from a passive observer, striking back at threats with deadly plasma, or by disrupting the very fabric of the world itself.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/V/VelKoz/VelKoz_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/f4ccf1814f268ba3fe7f19d9926f8413083443fe.webm', 62, 32, '2014-01-22', NULL),
('Vex', 'Vex', 'Shadow_Isles', 'Mage', 'the Gloomist', 'Just... ughhhhh.', 'In the black heart of the Shadow Isles, a lone yordle trudges through the spectral fog, content in its murky misery. With an endless supply of teen angst and a powerful shadow in tow, Vex lives in her own self-made slice of gloom, far from the revolting cheer of the “normie” world. Though she lacks ambition, she is quick to strike down color and happiness, stopping all would-be interlopers with her magical malaise.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/V/Vex/Vex_0.jpg', NULL, 65, 14, '2021-10-27', NULL),
('Vi', 'Vi', 'Piltover', 'Fighter', 'the Piltover Enforcer', 'We can either do this the hard way or… Oh wait, no. There\'s just the hard way.', 'Raised on the mean streets of Zaun, Vi is a hotheaded, impulsive, and fearsome woman with very little respect for authority. She has always been a shrewd survivor, both from her youthful troublemaking topside and an unfairly long stint in Stillwater Hold. Now working with the Piltover Enforcers to keep the peace instead of breaking it, she wields mighty hextech gauntlets that can punch through walls—and criminals—with equal ease.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/V/Vi/Vi_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/e52b22b97e6f6df98a0cb0b8cbd940a70f2dc47b.webm', 76, 19, '2012-12-19', NULL),
('Viego', 'Viego', 'Shadow_Isles', 'Fighter', 'the Ruined King', 'No price is too great. No atrocity beyond my reach. For her... I will do anything.', 'Once ruler of a long-lost kingdom, Viego perished over a thousand years ago when his attempt to bring his wife back from the dead triggered the magical catastrophe known as the Ruination. Transformed into a powerful, unliving wraith tortured by an obsessive longing for his centuries-dead queen, Viego now stands as the Ruined King, controlling the deadly Harrowings as he scours Runeterra for anything that might one day restore her, and destroying all in his path as the Black Mist pours endlessly from his cruel, broken heart.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/V/Viego/Viego_0.jpg', '', 80, 18, '2021-01-21', NULL),
('Viktor', 'Viktor', 'Zaun', 'Mage', 'Herald of the Arcane', 'Join the Glorious Evolution.', 'The fully biomechanical evolution of his former self, Viktor has embraced his Glorious Evolution and become something of a messiah to his followers. He sacrificed his own humanity under the logic that eliminating emotion would thereby eliminate suffering—and now seeks to bring the revelation of the hexcore to the rest of the world, even if they’re incapable of understanding the benefit. After all, to this master of the arcane, violence is merely a variable necessary to balance the ultimate equation.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/V/Viktor/Viktor_0.jpg', NULL, 45, 2, '2011-12-29', '2024-12-11'),
('Vladimir', 'Vladimir', 'Noxus', 'Mage', 'the Crimson Reaper', 'Time has made me wiser, but no more patient.', 'Afiend with a thirst for mortal blood, Vladimir has influenced the affairs of Noxus since the empire’s earliest days. In addition to unnaturally extending his life, his mastery of hemomancy allows him to control the minds and bodies of others as easily as his own. In the flamboyant salons of the Noxian aristocracy, this enabled him to build a fanatical cult of personality around himself—while in the lowest back alleys, it allows him to bleed his enemies dry.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/V/Vladimir/Vladimir_0.jpg', NULL, 84, 3, '2011-05-10', NULL),
('Volibear', 'Volibear', 'The_Freljord', 'Fighter', 'the Relentless Storm', 'They have forgotten the old ways. The old ways have not forgotten them.', 'To those who still revere him, the Volibear is the storm made manifest. Destructive, wild, and stubbornly resolute, he existed before mortals walked the Freljord’s tundra, and is fiercely protective of the lands that he and his demi-god kin created. Cultivating a deep hatred of civilization and the weakness it brought with it, he now fights to return to the old ways—when the land was untamed, and blood spilled freely—and eagerly battles all who oppose him, with tooth, claw, and thundering domination.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/V/Volibear/Volibear_0.jpg', '', 58, 4, '2011-11-29', NULL),
('Warwick', 'Warwick', 'Zaun', 'Fighter', 'The Uncaged Wrath of Zaun', 'Spill blood... draw the beast!', 'Warwick is a monster who hunts the gray alleys of Zaun. Transformed by agonizing experiments, his body is fused with an intricate system of chambers and pumps, machinery filling his veins with alchemical rage. He bursts from the shadows to prey upon those criminals who terrorize the city\'s depths. Warwick is drawn to blood, driven mad by its scent… and none who spill it can escape him.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/W/Warwick/Warwick_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/0949a15282f3a238556c54737b9a2feedbd88e2a.webm', 69, 61, '2009-02-21', NULL),
('Wukong', 'Wukong', 'Ionia', 'Fighter', 'the Monkey King', 'My journey is only beginning…', 'Wukong is a vastayan trickster who uses his strength, agility, and intelligence to confuse his opponents and gain the upper hand. After finding a lifelong friend in the warrior known as Master Yi, Wukong became the last student of the ancient martial art known as Wuju. Armed with an enchanted staff, Wukong seeks to prevent Ionia from falling to ruin.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/W/Wukong/Wukong_0.jpg', NULL, 70, 18, '2011-07-26', NULL),
('Xayah', 'Xayah', 'Ionia', 'Marksman', 'the Rebel', 'Cause then... I wouldn\'t get to hear you ask.', 'Deadly and precise, Xayah is a vastayan revolutionary waging a personal war to save her people. She uses her speed, guile, and razor-sharp feather blades to cut down anyone who stands in her way. Xayah fights alongside her partner and lover, Rakan, to protect their dwindling tribe, and restore their race to her vision of its former glory.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/R/Rakan_Xayah/Rakan_Xayah_0.jpg', '', 69, 24, '2017-09-27', NULL),
('Xerath', 'Xerath', 'Shurima', 'Mage', 'the Magus Ascendant', 'A lifetime as a slave has prepared me for eternity as your master.', 'Xerath is an Ascended Magus of ancient Shurima, a being of arcane energy writhing in the broken shards of a magical sarcophagus. For millennia, he was trapped beneath the desert sands, but the rise of Shurima freed him from his ancient prison. Driven insane with power, he now seeks to take what he believes is rightfully his and replace the upstart civilizations of the world with one fashioned in his image.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/X/Xerath/Xerath_0.jpg', NULL, 58, 3, '2017-05-04', NULL),
('XinZhao', 'Xin Zhao', 'Demacia', 'Fighter', 'the Seneschal of Demacia', 'Death is inevitable. One can only avoid defeat.', 'Xin Zhao is a resolute warrior loyal to the ruling Lightshield dynasty. Once condemned to the fighting pits of Noxus, he survived countless gladiatorial bouts, but after being freed by Demacian forces, he swore his life and allegiance to these brave liberators. Armed with his favored three-talon spear, Xin Zhao now fights for his adopted kingdom, audaciously challenging any foe, no matter the odds.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/X/XinZhao/XinZhao_0.jpg', NULL, 53, 27, '2010-07-13', NULL),
('Yasuo', 'Yasuo', 'Ionia', 'Fighter', 'the Unforgiven', 'Death is like the wind—always by my side.', ' An Ionian of deep resolve, Yasuo is an agile swordsman who wields the air itself against his enemies. As a proud young man, he was falsely accused of murdering his master—unable to prove his innocence, he was forced to slay his own brother in self-defense. In time, his master’s true killer was revealed, and his brother mysteriously returned from death, yet Yasuo still could not forgive himself for all he had done. Now, he wanders the world with only the wind to guide his blade.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/Y/Yasuo/Yasuo_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/64bf102eba34a29dfe59d0595f916a0848753141.webm', 88, 31, '2013-12-18', NULL),
('Yone', 'Yone', 'Ionia', 'Fighter', 'the Unforgotten', 'They look at me and see only the mask. I look at them and see only their fears.', 'In life, he was Yone—half-brother of Yasuo, and renowned student of his village\'s sword school. But upon his death at the hands of his brother, he found himself hunted by a malevolent entity of the spirit realm, and was forced to slay it with its own sword. Now, cursed to wear its demonic mask upon his face, Yone tirelessly hunts all such creatures in order to understand what he has become.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/Y/Yone/Yone_0.jpg', NULL, 59, 2, '2020-08-06', NULL),
('Yorick', 'Yorick', 'Shadow_Isles', 'Fighter', 'Shepherd of Souls', 'These isles… How they scream.', 'The last survivor of a long-forgotten religious order, Yorick is both blessed and cursed with power over the dead. Trapped on the Shadow Isles, his only companions are the rotting corpses and shrieking wraiths that he gathers to him. Yorick\'s monstrous actions belie his noble purpose: to free his home from the curse of the Ruination.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/Y/Yorick/Yorick_0.jpg', '', 70, 2, '2011-06-22', NULL),
('Yuumi', 'Yuumi', 'Bandle_City', 'Support', 'the Magical Cat', 'Cats are made of twilight and tricks, dogs are made of barks and sticks! Book’s just old trees.', 'A magical cat from Bandle City, Yuumi was once the familiar of a yordle enchantress, Norra. When her master mysteriously disappeared, Yuumi became the Keeper of Norra\'s sentient Book of Thresholds, traveling through portals in its pages to search for her. Yearning for affection, Yuumi seeks friendly companions to partner with on her journey, protecting them with luminous shields and fierce resolve. While Book strives to keep her on task, Yuumi is often drawn to worldly comforts, such as naps and fish. In the end, however, she always returns to her quest to find her friend.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/Y/Yuumi/Yuumi_0.jpg', NULL, 45, 6, '2019-06-12', NULL),
('Zac', 'Zac', 'Zaun', 'Tank', 'the Secret Weapon', 'The angrier you get, the more this is going to hurt...', 'Zac is the product of a toxic spill that ran through a chemtech seam and pooled in an isolated cavern deep in Zaun\'s Sump. Despite such humble origins, Zac has grown from primordial ooze into a thinking being who dwells in the city\'s pipes, occasionally emerging to help those who cannot help themselves or to rebuild the broken infrastructure of Zaun.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/Z/Zac/Zac_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/68372b4aa65c32e9aa6ee9a4198fdd4d15816cc3.webm', 76, 60, '2013-03-29', NULL),
('Zed', 'Zed', 'Ionia', 'Assassin', 'the Master of Shadows', 'The unseen blade is the deadliest.', 'Utterly ruthless and without mercy, Zed is the leader of the Order of Shadow, an organization he created with the intent of militarizing Ionia’s magical and martial traditions to drive out Noxian invaders. During the war, desperation led him to unlock the secret shadow form—a malevolent spirit magic as dangerous and corrupting as it is powerful. Zed has mastered all of these forbidden techniques to destroy anything he sees as a threat to his nation, or his new order.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/Z/Zed/Zed_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/5cb0965af44636e26e714ab08e77689950689f8c.webm', 73, 3, '2012-10-23', NULL),
('Zeri', 'Zeri', 'Zaun', 'Marksman', 'the Spark of Zaun', 'I belong here. We all belong here.', 'Aheadstrong, spirited young woman from Zaun’s working-class, Zeri channels her electric magic to charge herself and her custom-crafted gun. Her volatile power mirrors her emotions, its sparks reflecting her lightning-fast approach to life. Deeply compassionate toward others, Zeri carries the love of her family and her home into every fight. Though her eagerness to help can sometimes backfire, Zeri believes one truth to be certain: stand up for your community, and it will stand up with you.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/Z/Zeri/Zeri_0.jpg', '', 57, 28, '2022-01-20', NULL),
('Ziggs', 'Ziggs', 'Zaun', 'Mage', 'the Hexplosives Expert', 'Ziggs? Unpredictable, dangerous, yes yes. But quite brilliant!', 'With a love of big bombs and short fuses, the yordle Ziggs is an explosive force of nature. As an inventor\'s assistant in Piltover, he was bored by his predictable life and befriended a mad, blue-haired bomber named Jinx. After a wild night on the town, Ziggs took her advice and moved to Zaun, where he now explores his fascinations more freely, terrorizing the chem-barons and regular citizens alike in his never ending quest to blow stuff up.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/Z/Ziggs/Ziggs_0.jpg', '', 75, 33, '2012-03-26', NULL),
('Zilean', 'Zilean', 'Runeterra', 'Support', 'the Chronokeeper', 'There is no greater grief than for a loss that is yet to come.', 'Once a powerful Icathian mage, Zilean became obsessed with the passage of time after witnessing his homeland\'s destruction by the Void. Unable to spare even a minute to grieve the catastrophic loss, he called upon ancient temporal magic to divine all possible outcomes. Having become functionally immortal, Zilean now drifts through the past, present, and future, bending and warping the flow of time around him, always searching for that elusive moment that will turn back the clock and undo Icathia\'s destruction.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/Z/Zilean/Zilean_0.jpg', NULL, 61, 1, '2011-03-01', NULL),
('Zoe', 'Zoe', 'Targon', 'Mage', 'the Aspect of Twilight', 'I bring a message for you all—a warning, a sigil. But first, I wanna see the sparkleflies!', 'As the embodiment of mischief, imagination, and change, Zoe acts as the cosmic messenger of Targon, heralding major events that reshape worlds. Her mere presence warps the arcane mathematics governing realities, sometimes causing cataclysms without conscious effort or malice. This perhaps explains the breezy nonchalance with which Zoe approaches her duties, giving her plenty of time to focus on playing games, tricking mortals, or otherwise amusing herself. An encounter with Zoe can be joyous and life affirming, but it is always more than it appears and often extremely dangerous.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/Z/Zoe/Zoe_0.jpg', '', 55, 17, '2017-12-06', NULL),
('Zyra', 'Zyra', 'Ixtal', 'Mage', 'Rise of the Thorns', 'Where are your friends? Mine are all around…', ' Born in an ancient, sorcerous catastrophe, Zyra is the wrath of nature given form—an alluring hybrid of plant and human, kindling new life with every step. She views the many mortals of Valoran as little more than prey for her seeded progeny, and thinks nothing of slaying them with flurries of deadly spines. Though her true purpose has not been revealed, Zyra wanders the world, indulging her most primal urges to colonize, and strangle all other life from it.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Splash_Art/Z/Zyra/Zyra_0.jpg', 'https://cmsassets.rgpub.io/sanity/files/dsfx7636/universe/374f35f73d16ac029e6f67b3c399f8094d92109b.webm', 88, 5, '2016-03-31', NULL);
INSERT INTO `regions` (`id`, `name`, `title`, `story`, `icon`, `avatar`, `background`, `animated_background`) VALUES
('Bandle_City', 'Bandle City', '', 'Opinions differ as to where exactly the home of the yordles is to be found, though a handful of mortals claim to have traveled unseen pathways to a land of curious enchantment beyond the material realm. They tell of a place of unfettered magic, where the foolhardy can be led astray by myriad wonders, and end up lost in a dream...<br><br>\r\nIn Bandle City, it is said that every sensation is heightened for non-yordles. Colors are brighter. Food and drink intoxicates the senses for years and, once tasted, will never be forgotten. The sunlight is eternally golden, the waters crystal clear, and every harvest brings a fruitful bounty. Perhaps some of these claims are true, or maybe none—for no two taletellers ever seem to agree on what they actually saw.<br><br>\r\nOnly one thing is known for certain, and that is the timeless quality of Bandle City and its inhabitants. This might explain why those mortals who find their way back often appear to have aged tremendously, while many more never return at all.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/bandle_city/bandle_city_crest_icon.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/bandle_city/bandle_city_emblem.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/bandle_city/bandle_city_theme.jpg', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/bandle_city/bandle_city_theme.webm'),
('Bilgewater', 'Bilgewater', 'Lawless Port City', 'Nestled away in the Blue Flame Isles archipelago, Bilgewater is a port city like no other—home to serpent hunters, dock gangs, and smugglers from across the known world. Here, fortunes are made and ambitions shattered in the blink of an eye. For those fleeing justice, debt, or persecution, Bilgewater can be a place of new beginnings, for no one on these twisted streets cares about your past. Even so, with each new dawn, careless travelers can always be found floating in the harbor, their purses empty and their throats slit…<br><br>\r\nWhile incredibly dangerous, Bilgewater is ripe with opportunity, free from the shackles of formal government and trade regulation. If you have the coin, almost anything can be purchased here, from outlawed hextech to the favor of local crime lords.<br><br>\r\nWith the recent removal of the last “reaver king” of Bilgewater, the city has entered a period of transition, while the most prominent captains try to agree on its future. But as long as there are seaworthy ships and crews to sail them, Bilgewater is likely to remain one of the most colorful and well-connected places in Runeterra.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/bilgewater/bilgewater_crest_icon.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/bilgewater/bilgewater_emblem.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/bilgewater/bilgewater_theme.jpg', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/bilgewater/bilgewater_theme.webm'),
('Demacia', 'Demacia', 'Proud Military Kingdom', 'Astrong, lawful kingdom with a prestigious military history, Demacia’s people have always valued the ideals of justice, honor, and duty most highly, and are fiercely proud of their cultural heritage. But in spite of these lofty principles, this largely self-sufficient nation has grown more insular and isolationist in recent centuries.<br><br>\r\nNow, Demacia is a kingdom in turmoil.<br><br>\r\nThe capital, the Great City of Demacia, was founded as a refuge from sorcery after the nightmare of the Rune Wars, and built upon the riddle of petricite—a peculiar white stone that dampens magical energy. It is from here that the royal family has long seen to the defense of the outlying towns and villages, farmland, forests, and mountains rich with mineral resources.<br><br>\r\nHowever, following the sudden death of King Jarvan III, the other noble families have not yet approved the succession of his sole heir, young Prince Jarvan, to the throne.<br><br>\r\nThose who dwell beyond the heavily guarded borders are increasingly viewed with suspicion, and many former allies have begun to look elsewhere for protection, in these uncertain times. Some dare to whisper that the golden age of Demacia has passed, and unless its people are willing to adapt to a changing world—something many believe they are simply incapable of doing—the kingdom’s decline may be inevitable.<br><br>\r\nAnd all the petricite in the land will not protect Demacia from itself.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/demacia/demacia_crest_icon.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/demacia/demacia_emblem.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/demacia/demacia_theme.jpg', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/demacia/demacia_theme.webm'),
('Ionia', 'Ionia', 'The First Lands', 'Surrounded by treacherous seas, Ionia is composed of a number of allied provinces scattered across a massive archipelago, known to many as the First Lands. Since Ionian culture has long been shaped by the pursuit of balance in all things, the border between the material and spirit realms tends to be more permeable here, especially in the wild forests and mountains.<br><br>\r\nAlthough these lands’ enchantments can be fickle, its creatures dangerous and fae, for many centuries most Ionians led lives of plenty. The warrior monasteries, provincial militias—and even Ionia itself—had been enough to protect them.<br><br>\r\nBut that ended twelve years ago, when Noxus attacked the First Lands. The empire’s seemingly endless warhosts savaged Ionia, and were only defeated after many years, and at great cost.<br><br>\r\nNow, Ionia exists in an uneasy peace. Different reactions to the war have divided the region—some groups, such as the Shojin monks or the Kinkou, seek a return to isolationist pacifism, and pastoral traditions. Other more radical factions, such as the Navori Brotherhood and the Order of Shadow, demand a militarization of the land’s magic, to create a single, unified nation that can take vengeance on Noxus.<br><br>\r\nThe fate of Ionia hangs in a delicate balance that few are willing to overturn, but all can feel shifting uneasily beneath their feet.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/ionia/ionia_crest_icon.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/ionia/ionia_emblem.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/ionia/ionia_theme.jpg', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/ionia/ionia_theme.webm'),
('Ixtal', 'Ixtal', 'Perilous Easter Jungle', 'Renowned for its mastery of elemental magic, Ixtal was one of the first independent nations to join the Shuriman empire. In truth, Ixtali culture is much older—part of the great westward diaspora that gave rise to civilizations including the Buhru, magnificent Helia, and the ascetics of Targon—and it is likely they played a significant role in the creation of the first Ascended.<br><br>\r\nBut the mages of Ixtal survived the Void, and later the Darkin, by distancing themselves from their neighbors, drawing the wilderness around them like a shield. While much had already been lost, they were committed to the preservation of what little remained…<br><br>\r\nNow, secluded deep in the jungle for thousands of years, the sophisticated arcology-city of Ixaocan remains mostly free of outside influence. Having witnessed from afar the ruination of the Blessed Isles and the Rune Wars that followed, the Ixtali view all the other factions of Runeterra as upstarts and pretenders, and use their powerful magic to keep any intruders at bay.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/ixtal/ixtal_crest_icon.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/ixtal/ixtal_emblem.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/ixtal/ixtal_theme.jpg', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/ixtal/ixtal_theme.webm'),
('Noxus', 'Noxus', 'Burtal Expansionist Empire', 'Noxus is a powerful empire with a fearsome reputation. To those beyond its borders, it is brutal, expansionist, and threatening, yet those who look past its warlike exterior see an unusually inclusive society, where the strengths and talents of its people are respected and cultivated.<br><br>\r\nThe Noxii were once fierce barbarian tribes, until they stormed the ancient city that now lies at the heart of their domain. Under threat from all sides, they aggressively took the fight to their enemies, pushing their borders outward with each passing year. This struggle for survival has made modern Noxians a deeply proud people who value strength above all—though that strength can manifest in many different forms.<br><br>\r\nAnyone can rise to a position of power and respect within Noxus if they display the necessary aptitude, regardless of social standing, background, homeland, or wealth. Those who are able to wield magic are held in particularly high esteem, and are actively sought out in order that their special talents may be honed and best harnessed for the benefit of the empire.<br><br>\r\nBut in spite of this meritocratic ideal, the old noble houses still wield considerable power… and some fear that the greatest threat to Noxus comes not from its enemies, but from within.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/noxus/noxus_crest_icon.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/noxus/noxus_emblem.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/noxus/noxus_theme.jpg', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/noxus/noxus_theme.webm'),
('Piltover', 'Piltover', 'Dual City-States', 'Piltover is a thriving, progressive city whose power and influence is on the rise. It is Valoran’s cultural center, where art, craftsmanship, trade and innovation walk hand in hand. Its power comes not through military might, but the engines of commerce and forward thinking. Situated on the cliffs above the district of Zaun and overlooking the ocean, fleets of ships pass through its titanic sea-gates, bringing goods from all over the world. The wealth this generates has given rise to an unprecedented boom in the city’s growth. Piltover has - and still is - reinventing itself as a city where fortunes can be made and dreams can be lived. Burgeoning merchant clans fund development in the most incredible endeavors: grand artistic follies, esoteric hextech research, and architectural monuments to their power. With ever more inventors delving into the emergent lore of hextech, Piltover has become a lodestone for the most skilled craftsmen the world over.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/piltover/piltover_crest_icon.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/piltover/piltover_emblem.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/piltover/piltover_theme.jpg', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/piltover/piltover_theme.webm'),
('Runeterra', 'Runeterra', '', '', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/runeterra/runeterra_crest_icon.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/runeterra/runeterra_crest_icon.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Others/Runeterra_Terrain_map.webp', ''),
('Shadow_Isles', 'Shadow Isles', 'Lands Shrouded By The Black Mist', 'This cursed land was once home to a noble, enlightened civilization, known to its allies and emissaries as the Blessed Isles. However, more than a thousand years ago, an unprecedented magical cataclysm left the barrier between the material and spirit realms in tatters, effectively merging the two… and dooming all living things in an instant.<br><br>\r\nNow, a malevolent Black Mist permanently shrouds the Isles, and the earth itself is tainted by dark sorcery. Mortals who dare to venture to these dismal shores will slowly have their life force stolen away from them, which in turn attracts the insatiable, restless spirits of the dead.<br><br>\r\nThose who perish within the Mist are condemned to haunt this nightmarish place for eternity—worse still, the power of the Shadow Isles appears to wax stronger with every passing year, allowing the most powerful specters to roam farther and farther across Runeterra.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/shadow_isles/shadow_isles_crest_icon.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/shadow_isles/shadow_isles_emblem.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/shadow_isles/shadow_isles_theme.jpg', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/shadow_isles/shadow_isles_theme.webm'),
('Shurima', 'Shurima', 'Fallen Desert Empire', 'The empire of Shurima was once a thriving civilization that spanned an entire continent. Forged in a bygone age by the mighty god-warriors of the Ascended Host, it united all the disparate peoples of the south, and enforced a lasting peace between them.<br><br>\r\nFew dared to rebel. Those that did, like the accursed nation of Icathia, were crushed without mercy.<br><br>\r\nHowever, after several thousand years of growth and prosperity, the failed Ascension of Shurima’s last emperor left the capital in ruins, and tales of the empire’s former glory became little more than myth. Now, most of the nomadic inhabitants of Shurima’s deserts eke out a meager existence from the unforgiving land. Some have built small outposts to defend the few oases, while others delve into long lost catacombs in search of the untold riches that must surely lay buried there. There are also those who live as mercenaries, taking coin for their service before disappearing back into the lawless wastelands.<br><br>\r\nStill, a handful dare to dream of a return to the old ways. Indeed, more recently the tribes have been stirred by whispers from the heart of the desert—that their emperor Azir has returned, to lead them into a new, wondrous age.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/shurima/shurima_crest_icon.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/shurima/shurima_emblem.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/shurima/shurima_theme.jpg', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/shurima/shurima_theme.webm'),
('Targon', 'Targon', 'Sprawling Western Mountains ', 'Mount Targon is the mightiest peak in Runeterra, a towering peak of sun-baked rock amid a range of summits unmatched in scale anywhere else in the world. Located far from civilization, Mount Targon is utterly remote and all but impossible to reach save by the most determined seeker. Many legends cling to Mount Targon, and, like any place of myth, it is a beacon to dreamers, madmen and questors of adventure. Some of these brave souls attempt to scale the impossible mountain, perhaps seeking wisdom or enlightenment, perhaps chasing glory or some soul-deep yearning to witness its summit. The ascent is all but impossible, and those hardy few who somehow survive to reach the top almost never speak of what they have seen. Some return with a haunted, empty look in their eyes, others changed beyond all recognition, imbued by an Aspect of unearthly, inhuman power with a destiny few mortals can comprehend.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/targon/targon_crest_icon.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/targon/targon_emblem.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/targon/targon_theme.jpg', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/targon/targon_theme.webm'),
('The_Freljord', 'The Freljord', 'Harsh Frozen Land', 'The Freljord is a harsh and unforgiving place—where the people are born warriors, who must persevere against all odds.<br><br>\r\nProud and fiercely independent, the tribes of the Freljord are often considered wild, rugged, and “uncivilized” by their neighbors across Valoran, who do not know the ancient traditions that shaped them. Many thousands of years ago, the alliance between the sisters Avarosa, Serylda, and Lissandra was shattered in a war that unknowingly threatened all of Runeterra, plunging the northern lands into chaos, and near-constant winter. Now, only those truly exceptional mortals who seem immune to the ravages of fire or ice seem destined, or able, to lead.<br><br>\r\nDespite the best efforts of the Frostguard, myths and legends still endure of the old gods, the enigmatic yetis, and restless spirit walker shamans. The raiders of the Winter’s Claw range further with each passing year, harrying the borders of Demacia to the south, and the frontiers of Noxus to the east. Finally, seeking a more peaceful future, the fractious independent tribes and clans have begun to offer their allegiance to Ashe, young queen of the Avarosans.<br><br>\r\nEven so, the portents are grim. War is surely returning to the Freljord, and none can hope to escape it.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/the_freljord/the_freljord_crest_icon.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/the_freljord/the_freljord_emblem.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/the_freljord/the_freljord_theme.jpg', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/the_freljord/the_freljord_theme.webm'),
('The_Void', 'The Void', '', 'Screaming into existence with the birth of the universe, the Void is a manifestation of the unknowable nothingness that lies beyond. It is a force of insatiable hunger, waiting through the eons until its masters, the mysterious Watchers, mark the final time of undoing.<br><br>\r\nTo be a mortal touched by this power is to suffer an agonizing glimpse of eternal unreality, enough to shatter even the strongest mind. Denizens of the Void realm itself are construct-creatures, often of only limited sentience, but tasked with a singular purpose—to usher in total oblivion across Runeterra.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/the_void/the_void_crest_icon.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/the_void/the_void_crest_icon.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/the_void/the_void_theme.jpg', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/the_void/the_void_theme.webm'),
('Zaun', 'Zaun', 'Dual City-States', 'Zaun is a large, undercity district, lying in the deep canyons and valleys threading Piltover. What light reaches below is filtered through fumes leaking from the tangles of corroded pipework and reflected from the stained glass of its industrial architecture. Zaun and Piltover were once united, but are now separate, yet symbiotic societies. Though it exists in perpetual smogged twilight, Zaun thrives, its people vibrant and its culture rich. Piltover’s wealth has allowed Zaun to develop in tandem; a dark mirror of the city above. Many of the goods coming to Piltover find their way into Zaun’s black markets, and hextech inventors who find the restrictions placed upon them in the city above too restrictive often find their dangerous researches welcomed in Zaun. Unfettered development of volatile technologies and reckless industry has rendered whole swathes of Zaun polluted and dangerous. Streams of toxic runoff stagnate in the city’s lower reaches, but even here people find a way to exist and prosper.', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/zaun/zaun_crest_icon.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/zaun/zaun_emblem.png', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/zaun/zaun_theme.jpg', 'https://raw.githubusercontent.com/VietHung0712/AssetsLOL/refs/heads/main/Regions/zaun/zaun_theme.webm');
